(27, 'upload/gambar/Digital_Marketing.jpg', 'Creative Media menjadi Nara Sumber di Acara Seminar Nasional “Indonesian Creativepreneur in Digital Era”', '<p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:107%\">Pada 24 Oktober 2019, Creative Media di percaya menjadi\r\npembicara</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-ansi-language:IN\">/nara sumber</span><span style=\"font-size:12.0pt;\r\nline-height:107%\"> di Acara Seminar Nasional “Indonesian Creativepreneur in\r\nDigital Era</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-ansi-language:IN\">”</span><span style=\"font-size:12.0pt;line-height:107%\">\r\nyang diadakan oleh Laboratorium Cyber Marketing </span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">Universitas\r\nPembangunan Nasional (</span><span style=\"font-size:12.0pt;line-height:107%\">UPN</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">)</span><span style=\"font-size:12.0pt;line-height:107%\"> Veteran Jatim</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">. Ada 3</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%\"> </span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">Pembicara atau\r\nNarasumber pada Acara Seminar tersebut yaitu </span><span style=\"font-size:\r\n12.0pt;line-height:107%\">Hadi Sisyanto selaku Founder &amp; Creative Direct</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">o</span><span style=\"font-size:12.0pt;line-height:107%\">r yang mewakili Creative Media\r\nsebagai nara seumber,</span><span style=\"font-size:12.0pt;line-height:107%;\r\nmso-ansi-language:IN\"> </span><span style=\"font-size:12.0pt;line-height:107%\">Dodit\r\nMulyanto seorang Stand Up Comedian &amp; Chies Seorang Trainer Komunitas\r\nBukalapak. Acara </span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-ansi-language:IN\">Seminar</span><span lang=\"IN\" style=\"font-size:12.0pt;\r\nline-height:107%\"> </span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:\r\n107%;mso-ansi-language:IN\">ini </span><span style=\"font-size:12.0pt;line-height:\r\n107%\">diadakan di Convention Hall Arif Rahman Hakim – Surabaya.</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:107%\">Dalam kesempatan kali ini </span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">Creative Media\r\nmem</span><span style=\"font-size:12.0pt;line-height:107%\">beri</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">kan</span><span style=\"font-size:12.0pt;line-height:107%\"> materi tentang </span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">peran “</span><span style=\"font-size:12.0pt;line-height:107%\"><b>Digital Marketing</b></span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">” dalam\r\nmengembangkan Bisnis </span><span style=\"font-size:12.0pt;line-height:107%\">di </span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">E</span><span style=\"font-size:12.0pt;line-height:107%\">ra Digital. Seperti yang diketahui</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\"> bahwa\r\nkehadiran</span><span style=\"font-size:12.0pt;line-height:107%\"> Digital</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">isasi</span><span style=\"font-size:12.0pt;line-height:107%\"> sangat diminati oleh berbagai\r\nkalangan dari anak kecil hingga orang dewasa</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">.</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%\"> </span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">A</span><span style=\"font-size:12.0pt;line-height:107%\">palagi untuk seorang pengusaha di\r\njaman sekarang pastinya membutuhkan </span><span lang=\"IN\" style=\"font-size:12.0pt;\r\nline-height:107%;mso-ansi-language:IN\">pemasaran secara digital melalui\r\ninternet</span><span style=\"font-size:12.0pt;line-height:107%\"> untuk\r\nmemasarkan produk dan jasa mereka. Bagi </span><span lang=\"IN\" style=\"font-size:\r\n12.0pt;line-height:107%;mso-ansi-language:IN\">Anda </span><span style=\"font-size:12.0pt;line-height:107%\">yang belum tahu bagaimana </span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">memasarkan\r\n</span><span style=\"font-size:12.0pt;line-height:107%\">produk dan jasa </span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">agar\r\nlebih di</span><span style=\"font-size:12.0pt;line-height:107%\">kenal</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\"> oleh\r\npublik</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%\"> </span><span style=\"font-size:12.0pt;line-height:107%\">maka </span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;mso-ansi-language:IN\">Anda harus\r\nbelajar “<b>D</b></span><span style=\"font-size:12.0pt;line-height:107%\"><b>igital\r\nMarketing</b>”</span><span lang=\"IN\" style=\"font-size:12.0pt;line-height:107%;\r\nmso-ansi-language:IN\">. Dengan pemasaran melalui <b>Digital Marketing</b> maka produk\r\ndan jasa Anda akan lebih mudah dikenal oleh banyak pelanggan dari berbagai\r\nkalangan dan penjuru dunia.</span></p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b>Digital marketing</b> adalah segala upaya untuk\r\nmelakukan pemasaran suatu produk dan jasa melalui media internet. Pemasaran\r\ndalam internet marketing bukan hanya untuk meningkatkan penjualan, tapi juga\r\ntermasuk promosi produk dan jasa baru, branding, dan membina hubungan dengan\r\npelanggan. <o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Nah, bagi </span><span lang=\"IN\" style=\"font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">A</span><span style=\"font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">nda yang ingin\r\njuga mempelajari </span><span lang=\"IN\" style=\"font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">keilmuwan “</span><span style=\"font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b>Digital Marketing</b>”</span><span style=\"font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> <span lang=\"IN\">untuk pemasaran produk dan jasa Anda </span></span><span style=\"font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Creative Media\r\nlah tempatnya. </span><span lang=\"IN\" style=\"font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Disini Anda akan diajarkan secara detail\r\nmulai dari Basic hingga Advanced bagaimana agara produk dan jasa Anda dibanjiri\r\noleh Order. </span><span style=\"font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Yuk\r\nlangsung aja hubungi Custimer Service kami via WA di 0821 3131 4040 (Ayu) /\r\n0821 3131 0210 (Dhea) </span><span style=\"font-size: 12pt; line-height: 107%; background: rgb(254, 254, 254);\">atau bisa telpon di 031 - 7328540\r\n/ 031 – 59173739.</span><span style=\"font-size:12.0pt;line-height:107%;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;background:#FEFEFE\"><o:p></o:p></span></p>', 'Publish', 'Editor Creative Media', '', '2019-11-25 17:19:04', '0000-00-00 00:00:00'),
(28, 'upload/gambar/Bursa-Efek-Indonesia.jpg', 'Training Design Grafis Creative Media Bersama PT Bursa Efek Indonesia', '<p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">PT. Bursa Efek Indonesia (BEI)</strong>&nbsp;atau Indonesia Stock Exchange (IDX) adalah pihak yang menyelenggarakan dan menyediakan sistem juga sarana untuk mempertemukan penawaran jual dan beli Efek pihak-pihak lain dengan tujuan memperdagangkan Efek di antara mereka. PT. Bursa Efek Indonesia itu sendiri memiliki kantor perwailan dibeberapa daerah, salah satunya yaitu di Kota Surabaya.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Creative Media dipercaya oleh PT. Bursa Efek Indonesia (BEI) untuk melaksanakan Corporate&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Training Design Grafis</strong>. Pada training kali ini diikuti oleh 3 peserta yaitu Ibu Esti Firdani, Bpk. Rahmat Fajar Basarda dan Ibu Hesty Tri Budiharti. Pada&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Training Design Grafis</strong>&nbsp;kali ini dibimbing oleh tentor kami yaitu Bpk. M. Jeffry Rizqiansyah yang memang ahli dibidangnya. Tidak hanya sekedar materi saja yang diberikan tapi, peserta juga diajak untuk praktek secara langsung untuk mengetahui cara penggunaan aplikasi Corell Draw dan Adobe Photoshop dengan baik dan benar. Dalam praktik yang diberikan peserta juga belajar cara design logo, ID card, Brosur, dll.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Training Design Grafis</strong>&nbsp;kali ini dilaksanakan pada tanggal 29 Oktober – 26 November 2019 dan training dilaksanakan secara langsung di kantor PT. Bursa Efek Indonesia yang berada di Surabaya. Dengan diadakan training ini diharapkan para peserta dapat menambah ilmu tentang&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Design Grafis</strong>&nbsp;yang dapat menunjang kinerja para peserta.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Nah, bagi anda yang ingin training ataupun kursus IT &amp; Multimedia di Creative Media bisa langsung menghubungi kami di 0821 3131 4040 / 0821 3131 0210 atau bisa telpon di 031 – 7328540 / 031 – 59173739. Karena disini akan dibimbing langsung oleh trainer yang memang berpengalaman dibidangnya, atau anda bisa kunjungi kami secara langsung di www.creativemedia.id</p>', 'Publish', 'Konten Kreator', '', '2021-11-08 09:04:26', '0000-00-00 00:00:00'),
(29, 'upload/gambar/UM.jpg', 'Training Editing Video Multimedia dan Web Design CMS Creative Media bersama Universitas Negeri Malang (UM)', '<p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Universitas Negeri Malang</strong>, disingkat UM, merupakan perguruan tinggi negeri yang terletak di Malang dan Blitar, Jawa Timur, Indonesia. Universitas yang didirikan pada tanggal 18 Oktober 1954 ini sebelumnya bernama PTPG Malang, lalu IKIP Malang yang membuatnya menjadi salah satu IKIP tertua di Indonesia.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Creative Media dipercaya oleh Universitas Negeri Malang (UM) untuk melaksanakan Corporate&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Training Editing Video Multimedia dan Web Design CMS</strong>. Pada training kali ini diikuti oleh 4 peserta diantaranya adalah Bpk. Muhammad Ghani Rozaq, A.Md., Ibu Dyah Ayu Dwi Kusuma Ningrum, S.Sn., Bpk. Danny Ajar Baskoro, S.E., S.Pd., M.Pd., dan Bpk. Ahmad Priyono, S.E.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada Training kali ini dibimbing oleh trainer kami yaitu Ibu Tika Safitri sebagai trainer&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Editing Video Multimedia</strong>&nbsp;dan Bpk. Johanes Adi Kristanto sebagai trainer&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Web Design CMS</strong>&nbsp;yang sudah ahli dibidangnya. Tidak hanya sekedar materi saja yang diberikan tapi, peserta juga diajak untuk praktik secara langsung untuk mengetahui aplikasi-aplikas yang dipakai.&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Editing Video Multimedia</strong>&nbsp;menggunakan aplikasi Adobe Premier dan Adobe After Effect, sedangkan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Web Design CMS</strong>&nbsp;menggunakan aplikasi&nbsp;<em style=\"border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">open source&nbsp;</em>WordPress.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Peserta training&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Editing Video Multimedia</strong>&nbsp;diajarkan bagaimana cara penggunaan software dengan baik dan benar agar menghasilkan Video Editing yang menarik. Sedangkan peserta training&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Web Design CMS</strong>&nbsp;diajarkan bagaimana cara membuat website tanpa koding pemrograman tetapi tetap menghasilkan website yang menarik dan interaktif.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Training Editing Video Multimedia dan Web Design CMS</strong>&nbsp;kali ini dilaksanakan pada tanggal 12 – 14 November 2019 dan training dilaksanakan di kantor Creative Media Surabaya. Dengan dilaksanakannya training ini diharapkan peserta dapat menambah ilmu tentang&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Editing Video Multimedia dan Web Design CMS</strong>&nbsp;yang dapat menunjang kinerja para pekerja.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Nah, bagi anda yang ingin training ataupun kursus IT &amp; Multimedia di Creative Media bisa langsung menghubungi kami di 0821 3131 4040 / 0821 3131 0210 atau bisa telpon di 031 – 7328540 / 031 – 59173739. Karena disini akan dibimbing langsung oleh trainer yang memang berpengalaman dibidangnya, atau anda bisa kunjungi kami secara langsung di www.creativemedia.id</p>', 'Publish', 'Konten Kreator', '', '2021-11-08 09:05:38', '0000-00-00 00:00:00'),
(30, 'upload/gambar/Training-Photography-dan-Videography.jpg', 'Training Photography dan Videography Creative Media bersama Balai Besar Teknik Kesehatan Lingkungan dan Pengendalian Penyakit (BBTKPL PP) Surabaya', '<p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Balai Besar Teknik Kesehatan Lingkungan dan Pengendalian Peyakit (BBTKPL PP) Surabaya</strong>&nbsp;merupakan Unit Pelaksana Teknis (UPT) Kementerian Kesehatan RI yang berada di bawah dan bertanggungjawab kepada Direktorat Jenderal Pengendalian Penyakit dan Penyehatan Lingkungan dengan&nbsp; dasar hukum Peraturan Menteri Kesehatan RI No. 2349/MENKES/PER/XI/2011 tentang Organisasi dan Tata Kerja Unit Pelaksana Teknis di Bidang Teknik Kesehatan Lingkungan dan Pengendalian Penyakit. BBTKL PP Surabaya melakukan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Training Photography dan Videography</strong>.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Creative Media dipercaya oleh Balai Besar Teknik Kesehatan Lingkungan dan Pengendalian Peyakit (BBTKPL PP) Surabaya untuk melaksanakan Corporate&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Training Photography dan Videography.&nbsp;</strong>Pada training kali ini diikuti oleh 8 peserta diantaranya adalah Auliya Qurrota A’yun, Efi Sriwahyuni, Siti Nur Hidayati, Lestyawan Sattoto, Nugroho Anang Prasetyo, Ronny Koesnariyanto, M. Nuril Walidi M.B. dan Ratna Ayu Permananingtyas.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Training Photography dan Videography</strong>&nbsp;kali ini dibimbing langsung oleh trainer kami yaitu Bpk. Nur Sessa Wibisana yang memang ahli dibidangnya. Tidak hanya sekedar materi saja yang diberikan tapi peserta training juga diajak secara langsung untuk praktek satu persatu untuk mengetahui cara pengambilan foto dan video dengan baik dan benar. Selain itu, peserta juga diajarkan cara mengedit foto menggunakan aplikasi Adobe Photoshop.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Training Photography dan Videography&nbsp;</strong>kali ini dilaksanana pada tanggal 13- 15 November 2019 dan training dilaksanan secara langsung di kantor BBTKPL PP Surabaya. Dengan diadakannya training ini diharapkan dapat meningkatkan pengetahuan peserta dalam bidang photography dan videography, serta dapat menerapkan materi dalam menunjang kinerja para peserta training.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Nah, bagi anda yang ingin training ataupun kursus IT &amp; Multimedia seperti&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Training Photography dan Videography</strong>&nbsp;di Creative Media bisa langsung hubungi kami di 0821 3131 4040 / 0821 3131 0210 atau bisa telpon di 031 – 7328540 / 031 – 59173739. Karena disini akan dibimbing langsung oleh trainer yang memang berpengalaman dibidangnya, atau anda bisa kunjungi kami secara langsung di www.creativemedia.id</p>', 'Publish', 'Konten Kreator', '', '2021-11-08 09:06:29', '0000-00-00 00:00:00'),
(31, 'upload/gambar/anniversary.jpg', 'Anniversary 5th dan Launching Logo Creative Media', '<p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Creative Media merupakan perusahaan Digital Agency &amp; IT Consultant di Surabaya. Creative Media sudah berdiri sejak tahun 2014, kami memiliki 2 Kantor yaitu Head Office yang berada di Jl. Tubanan Baru Surabaya dan Branch Office yang berada di Jl. Nginden Intan Timur Surabaya.</p><p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Kami berfokus pada Computer Course &amp; Trainings, Branding &amp; Design,&nbsp;Web Development, Mobile Apps Development. Dengan komitmen yang kuat, mengembangkan kualitas pendidikan non formal khususnya IT &amp; Multimedia di Surabaya. Kami merupakan Lembaga Pendidikan Non Formal yang Resmi mendapat izin penyelenggaraan, apresiasi dan dukungan penuh dari Dinas Pendidikan Surabaya.</p><p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada tanggal 13 Desember 2019 Creative Media merayakan anniversary perusahaan yang ke-5 tahun, acara ini juga bersamaan dengan acara Launching Logo baru Creative Media. Acara Anniversary 5th dan Launching Logo Creative Media bertempat di kantor Branch Office Creative Media Nginden Surabaya. Acara ini dihadiri oleh beberapa undangan diantaranya yaitu seluruh Staff dan Tentor Creative Media.</p><p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Acara Anniversary Creative Media diadakan setiap tahun, sebagai rasa syukur atas kepercayaan customer terhadap Creative Media dan rasa terimakasih Creative Media kepada seluruh Trainer Creative Media yang senantiasa bekerjasama dalam proses belajar mengajar. Trainer Creative Media mempunyai peran yang sangat penting di Lembaga ini, selain memberikan pembelajaran hard skill sesuai bidang studi yang ingin dipelajari, tentor harus mampu memotivasi dan membangun pendidikan karakter. Karena proses pembelajaran di level apapun membutuhkan Interaksi, Gotong Royong, Debat, Diskusi dan Pemikiran Kritis.</p><p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Dalam acara Anniversary Creative Media ini Bpk. Hadi Sisyanto selaku Direktur Creative Media juga berterimakasih kepada para staff atas dedikasinya kepada perusahaan. Kami mampu bertahan dan bersaing dengan kompetitor tentunya bukan hal mudah. Membutuhkan pemikiran yang kritis, kerja keras, kreasi dan inovasi sehingga menghasilkan produk-produk pembelajaran yang berkualitas.</p><p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Maka dari itu, Creative Media memberikan reward kepada para staff dan trainer. Reward kali ini terdapat dua kategori yaitu “Staff of the year” yang dimenangkan oleh Bpk. Muhammad Fathoni dan “Trainer of the year” yang dimenangkan oleh Ibu Lailatul Aisyah.</p><p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Sesuai dengan instruksi Dinas Pendidikan, di Tahun 2020 nanti akan ada kebijakan baru tentang penilaian tentang proses pembelajaran untuk menghasilkan produk yang berkualitas dengan indikator-indokator yang sudah tertuang didalam Standar Operasional Prosedur (SOP). Memang melakukan perubahan itu sesuatu yang sangat tidak nyaman, tapi jika kita tidak melakukan perubahan yang lebih baik maka akan menjadi lembaga yang tertindas .</p><p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Creative Media melakukan rebranding setelah berdiri 5 tahun, dengan ini Creative Media kedepannya diharapkan dapat menjadi Lembaga Pendidikan yang lebih kompeten, bisa dikenal banyak orang dan menghasilkan lulusan-lulusan yang mampu bersaing di Era Milenial ini, serta SDM yang semakin produktif dan mampu menciptakan inovasi-inovasi baru untuk kemajuan indonesia.</p><p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Nah, bagi anda yang ingin training ataupun kursus IT &amp; Multimedia di Creative Media bisa langsung hubungi kami di 0821 3131 4040 / 0821 3131 0210 atau bisa telpon di 031 – 7328540 / 031 – 59173739. Karena disini akan dibimbing langsung oleh trainer yang memang berpengalaman dibidangnya, atau anda bisa kunjungi kami secara langsung di www.creativemedia.id</p>', 'Publish', 'Konten Kreator', '', '2021-11-08 09:07:44', '0000-00-00 00:00:00'),
(32, 'upload/gambar/Seminar.jpg', 'Creative Media Menjadi Narasumber di Acara Seminar Nasional “Industri Kreatif”', '<p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Universitas Muhammadiyah Sidoarjo</strong>&nbsp;atau disingkat UMSIDA adalah sebagai Perguruan Tinggi yang Menjadi Pusat Pengembangan Sumber Daya Manusia, Ilmu Pengetahuan dan Teknologi Berdasarkan Nilai-Nilai Islam. Universitas ini berlokasi di Sidoarjo, Jawa Timur, Indonesia.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada tanggal 11 Januari 2020, Creative Media menjadi pembicara/narasumber di Acara&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Seminar Nasional “Industri Creative”</strong>&nbsp;yang diadakan oleh&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Universitas Muhammadiyah Sidoarjo (UMSIDA)</strong>. Creative Media menjadi satu-satunya narasumber yang diwakili oleh Bpk. Hadi Sisyanto selaku Founder dan Creative Director Creative Media. Acara ini diadakan di Universitas Muhammadiyah Sidoarjo (UMSIDA) Kampus 2.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Dalam kesempatan kali ini Creative Media memberikan materi tentang&nbsp;&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">“Menumbuhkan Minat dan Creative dalam Berkarya di Dunia Industri Creative”</strong>.&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Industri Creative</strong>&nbsp;itu sendiri adalah industri yang mentransformasi dan memanfaatkan kreativitas, keterampilan dan kekayaan intelektual untuk menghasilkan barang dan jasa. Seperti yang diketahui bahwa&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Industri Cretive&nbsp;</strong>di Indonesia semakin berkembang dan banyak menciptakan peluang, beberapa peluang diantaranya adalah animator, desainer video game, desainer produk komersial &amp; industri, youtuber, content creator, desainer interior, desainer web, Mobile Apps Developer, dll.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada kesempatan kali ini Creative Media juga membahas beberapa strategi campaign dalam pengembangan bisnis di&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Industri Creative</strong>. Strategi campaign itu sendiri bisa menggunakan tradisonal marketing seperti brosur dan pamflate, atau bisa juga menggunakan campaign digital diantaranya yaitu digital marketing, penggunaan website pada perusahaan, Search Engine Marketing baik itu SEO maupun Google Ads, Sosial Media Marketing, dll. Campaign digital saat ini lebih banyak digunakan karena dengan berkembangnya teknologi juga membuat semua aspek menjadi mudah diakses.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Nah, bagi Anda yang ingin juga mempelajari keilmuwan “Digital Marketing” untuk pemasaran produk dan jasa di&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Industri Kreatif</strong>, atau ingin juga mempelajari keilmuan “Pemrograman” untuk membuat website perusahaan Anda, Creative Media lah tempatnya. Disini Anda akan diajarkan secara detail mulai dari Basic hingga Advanced. Yuk langsung aja hubungi Custimer Service kami via WA di 0821 3131 4040 (Ayu) / 0821 3131 0210 (Dhea) atau bisa telpon di 031 – 7328540 / 031 – 59173739.</p>', 'Publish', 'Konten Kreator', '', '2021-11-08 09:08:48', '0000-00-00 00:00:00'),
(33, 'upload/gambar/kartu-prakerja.jpg', 'Kementerian Koordinator Bidang Perekonomian (Kemenko Perekonomian) melakukan kunjungan ke Creative Media', '<p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kementerian Koordinator Bidang Perekonomian (Kemenko Perekonomian)</strong>&nbsp;yang sebelumnya bernama Menteri Koordinator Bidang Ekonomi, Keuangan, dan Industri adalah Kementerian dalam Pemerintah Indonesia yang membidangi koordinasi dan sinkronisasi penyiapan dan penyusunan kebijakan serta pelaksanaannya di bidang perekonomian. Kemenko Perekonomian dipimpin oleh seorang Menteri Koordinator Bidang Perekonomian (Menko Perekonomian) yang sejak tanggal 12 Agustus 2015 dijabat oleh Bpk. Darmin Nasution.</p><p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pemerintah saat ini sedang menyiapkan Program Kartu Prakerja dan akan diimplementasikan dalam waktu dekat. Program Kartu Prakerja merupakan program yang bertujuan untuk pengembangan kompetensi kerja bagi pencari kerja, pekerja/buruh yang terkena pemutusan hubungan kerja, dan/atau pekerja/buruh yang membutuhkan peningkatan kompetensi. Agar program ini dapat berjalan, pemerintah bekerjasama dengan beberapa Platform E-Commerce dan Platform Pendidikan.</p><p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada tanggal 17 Januari 2020 Kementerian Koordinator Bidang Perekonomian (Kemenko Perekonomian) melakukan kunjungan ke Creative Media. Kunjungan tersebut dihadiri oleh Bpk. Dr. Ir. Mohammad Rudy Salahuddin, MEM selaku Deputi Bidang Koordinasi Ekonomi Kreatif, Kewirausahaan, dan Daya Saing Koperasi dan Usaha Kecil dan Menengah beserta dua Staff. Kunjungan kerja ini bertujuan untuk melihat kesiapan lembaga pelatihan dalam mendukung implementasi Program Kartu Prakerja.</p><p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Melalui programan tersebut, penerima Kartu Prakerja akan mendapatkan pelatihan berbasis kompetensi kerja yang sesuai dengan kebutuhan pasar kerja. Pelatihan tersebut dapat diselenggarakan oleh lembaga pelatihan yang dimiliki oleh swasta, BUMN, BUMD, dan/atau Pemerintah. Salah satu Lembaga Pelatihan Swasta yang dikunjungi oleh Kemenko Perekonomian yaitu Creative Media.</p><p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Dalam kunjungan ini Kemenko Perekonomian menawarkan kerjasama dengan Creative Media sebagai Lembaga Pelatihan yang dapat menampung para penerima Kartu Prakerja sesuai dengan jumlah peserta yang sudah disepakati bersama. Pelatihan yang diberikan sesuai dengan bidang studi yang ada di Creative Media dan sesuai dengan kebutuhan pasar kerja, seperti Digital Marketing, Design Grafis, Editing Video Multimedia, dll.</p><p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Program Kartu Prakerja ini diharapkan akan berlangsung pada tahun 2020, dan dapat berjalan dengan baik guna menunjang perekonomian masyarakat Indonesia.</p><p align=\"justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Nah, bagi anda yang ingin training ataupun kursus IT &amp; Multimedia seperti&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Training Photography dan Videography</strong>&nbsp;di Creative Media bisa langsung hubungi kami di 0821 3131 4040 / 0821 3131 0210 atau bisa telpon di 031 – 7328540 / 031 – 59173739. Karena disini akan dibimbing langsung oleh trainer yang memang berpengalaman dibidangnya, atau anda bisa kunjungi kami secara langsung di www.creativemedia.id</p>', 'Publish', 'Konten Kreator', '', '2021-11-08 09:11:12', '0000-00-00 00:00:00'),
(34, 'upload/gambar/Training-Photography-Videography-Surabaya-1.jpg', 'Pelatihan Photography & Videography di Surabaya bersama Diskominfo Kab. Katingan-Kalimantan Tengah', '<p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Dinas Komunikasi dan Informatika&nbsp;merupakan unsur pelaksana urusan pemerintahan bidang&nbsp;komunikasi dan informatika, urusan pemerintahan bidang persandian, dan urusan pemerintahan bidang statistik yang dipimpin oleh Kepala&nbsp;Dinas&nbsp;yang berkedudukan di bawah dan bertanggung jawab kepada Bupati melalui Sekretaris Daerah. Bidang Statistik dan Persandian mempunyai tugas melaksanakan pengkoordinasian, perumusan penetapan kebijakan dan perencanaan program di bidang pengumpulan data statistic sektoral, pengolahan data dan diseminasi statistic sektoral serta persandian. Seiring berkembangnya waktu tuntutan dari instansi semakin tinggi sehingga Diskominfo mempunyai tanggung jawab lebih tinggi dan harus melakukan upgrade skill sehingga terbentuknya&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Photography &amp; Videography di Surabaya</strong>.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Fotografi (dari bahasa Inggris: photography, yang berasal dari kata Yunani yaitu “photos”: cahaya dan “grafo”: melukis/menulis) adalah proses melukis/menulis dengan menggunakan media cahaya. Sebagai istilah umum, fotografi berarti proses atau metode untuk menghasilkan gambar atau foto dari suatu objek dengan merekam pantulan cahaya yang mengenai objek tersebut pada media yang peka cahaya [<a href=\"https://id.wikipedia.org/wiki/Fotografi\" target=\"_blank\" rel=\"noreferrer noopener\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: royalblue; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\"><em style=\"border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">wikipedia.org</em></a>].</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Creative Media dipercaya oleh Dinas Komunikasi dan Informatika Persandian &amp; Statistik Kabupaten Katingan, Kalimantan Tengah untuk melaksanakan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Photography &amp; Videography di Surabaya</strong>, Training dilaksanakan selama 4 hari yaitu 18 – 21 Februari 2020 di Kantor cabang kami yang berada di Jl. Nginden Intan Timur XVIII/A3-10, Surabaya. Training diikuti oleh 4 siswa &nbsp;diantaranya Ibu Martina Hermin, SE., Ibu Siti Marhamah, S.Kom., Ibu Novia Ayu Nanda Safitri, S.Sos., dan Bpk. Akhmad Rizal, dan dibimbing langsung oleh Bpk. Nur Wisesa Wibisana yang memang ahli dibidangnya.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada sesi&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Photography &amp; Videography di Surabaya</strong>&nbsp;materi yang diajarkan adalah Teknik pengambilan shoot atau gambar, teknik editing dan rendering/finishing menggunakan Adobe Photoshop, Adobe Premiere, dan Adobe After Effect. Pada pelatihan kali ini peserta mendapatkan materi outdoor untuk melakukan penerapan materi yang diajarkan dikelas sehingga mampu mengimplementasikan materi dengan maksimal saat terjun di lapangan.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Sudah lebih dari&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">1.600 Orang</strong>&nbsp;mengikuti Kursus dan Pelatihan bersama kami. Segera Booking Kelas &amp; Jadwal untuk mendapatkan Trainer Terbaik. Langsung aja hubungi&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Customer Service Officer</strong>&nbsp;kami via Whatsapp di&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131314040</strong>&nbsp;(Ayu) atau&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131310210</strong>&nbsp;(Dhea).</p>', 'Publish', 'Konten Kreator', '', '2021-11-08 14:10:55', '0000-00-00 00:00:00'),
(35, 'upload/gambar/Training-Animasi-Infografis-1.jpg', 'Pelatihan Animasi Infografis Bersama PT. SPIL PACIFIC INDONESIAN LINES', '<p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">PT. SPIL PACIFIC INDONESIAN LINES merupakan perusahaan shipping logistics (shiplog) yang memiliki jaringan di seluruh wilayah Indonesia, memberikan solusi pengiriman logistic dan pelayaran. Untuk kesekian kalinya PT. SPIL mengikuti Pelatihan di Creative Media mulai dari bidang studi&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Videography</strong>&nbsp;hingga&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Animasi Infografis</strong>. Untuk kali ini bidang studi yang diambil&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Animasi Infografis</strong>.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Infografis</strong>&nbsp;adalah bentuk visualisasi data yang menyampaikan informasi kompleks kepada pembaca agar lebih mudah dan lebih cepat dipahami secara keseluruhan. Menyampaikan informasi secara visual juga sudah dikenal sejak lama, seperti pada zaman manusia purba dimana banyak terdapat lukisan di dalam gua yang menggambarkan suatu kejadian. Peneliti mengatakan bahwa penyampaian informasi secara visual memiliki banyak keuntungan dibandingkan dengan teks, karena manusia dapat jauh lebih cepat menangkap informasi yang disampaikan. Salah satu kelebihan dari infografis sendiri dikarenakan informasi yang ditangkap secara visual akan langsung diproses sekaligus oleh otak, berbeda dengan informasi yang disampaikan via teks atau kalimat dimana informasi akan diproses secara linear (dari awal kalimat hingga ke ujung kalimat). [<a href=\"https://dosenpintar.com/\" target=\"_blank\" rel=\"noreferrer noopener\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: royalblue; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\"><em style=\"border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">dosenpintar.com</em></a>]</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Animasi Infografis</strong>&nbsp;dilaksanakan di kantor cabang kami di Jl. Nginden Intan Timur XVIII blok A3/10, Surabaya. Pelatihan ini diikuti oleh 3 Peserta dari Staff Internal Perusahaan yang berlangsung pada tanggal 13 Maret – 15 April 2020. Nama-nama peserta pelatihan pada sesi ini adalah Bpk. Roland Nussman Wetik, Ibu Adelia Happy Rizky Ramadhani, dan Ibu Benedicta Cornelia Naldo.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Dalam kegiatan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Animasi Infografis</strong>&nbsp;kali ini dibimbing langsung oleh Trainer profesional kami yaitu Bpk. Kurniawan yang memang ahli dibidangnya. Peserta tidak hanya dibekali materi berupa teori namun langsung praktek dalam pembuatan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Animasi Infografis</strong>&nbsp;menggunakan komputer. Terlihat peserta sangat antusias dalam menerima materi yang diberikan, pelatihan ini bertujuan agar peserta bisa membuat Animasi Infografis secara mandiri dan nantinya dari materi yang diberikan bisa diterapkan dalam kegiatan atau program di internal perusahaan.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Sudah lebih dari 1.600 Orang mengikuti Kursus dan Pelatihan bersama kami. Segera Booking Kelas &amp; Jadwal untuk mendapatkan Trainer Terbaik. Langsung aja hubungi Customer Service Officer kami via Whatsapp di 082131314040 (Ayu) atau 082131310210 (Dhea).</p>', 'Publish', 'Konten Kreator', '', '2021-11-08 14:11:55', '0000-00-00 00:00:00');
INSERT INTO `artikel` (`id_artikel`, `gambar`, `judul`, `deskripsi`, `status`, `created_by`, `updated_by`, `created_date`, `updated_date`) VALUES
(36, 'upload/gambar/Training-Administrasi-Perkantoran-1.jpg', 'Pelatihan Administrasi Perkantoran Bersama Fakultas Ekonomi Universitas Negeri Malang', '<p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Fakultas Ekonomi Universitas Negeri Malang&nbsp;adalah salah satu fakultas di Universitas Negeri Malang.&nbsp;Fakultas Ekonomi Universitas Negeri Malang&nbsp;atau disingkat&nbsp;FE UM&nbsp;didirikan pada&nbsp;tanggal&nbsp;3 November 2000. FE UM memiliki visi sebagai fakultas yang unggul dalam mencetak kader bangsa yang kreatif, memiliki daya saing, dan peduli terhadap nilai-nilai kemanusiaan, serta menjadi rujukan pengembangan bidang pendidikan ekonomi dan ilmu ekonomi.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Kali ini FE Universitas Negeri Malang mempercayakan Creative Media untuk melaksanakan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Administrasi Perkantoran</strong>. Training dilaksanakan selama 4 hari pada tanggal 02 s.d 05 November 2020 dan diikuti oleh 5 peserta yaitu Bpk. Andik Setiawan, Bpk. Ahmad Priyono, Bpk. Nandhika Gatama, Bpk. Amin Syaifuddin, dan Bpk. Danny Ajar Baskoro, materi pada pelatihan ini adalah Manajemen Perkantoran Modern.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Manajemen Perkantoran Modern merupakan manajemen perkantoran terbaru/mutakhir, memanfaatkan sikap, pikiran tingkah laku modern. Ditunjang oleh pemanfaatan teknologi modern, yaitu teknologi terbaru/mutakhir yang sesuai dengan pembaharuan, sehingga sesuai dengan perkembangan zaman. Dengan menerapkan manajemen perkantoran modern: Terjadi perubahan luar biasa dalam proses implementasi fungsi manajemen, menerapkan teknologi modern berlandaskan azas demokratisasi, keterbukaan, akuntabilitas, transparansi, proporsional dan profesional. Menerapkan ilmu manajemen modern yang merespon tantangan dan ancaman. [<a href=\"https://www.patrarijaya.co.id/manajemen-administrasi-perkantoran-modern/\" target=\"_blank\" rel=\"noreferrer noopener\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: royalblue; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\"><em style=\"border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">patrarijaya</em></a>]</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Administrasi Perkantoran</strong>&nbsp;dibimbing langsung oleh trainer profesional kami yaitu Ibu Septyan Windi, aplikasi yang digunakan dalam training kali ini yaitu Microsoft office yang meliputi Ms. Word, Ms. Excel, dan Ms. Power Point. Materi inti dari pelatihan ini adalah Administrasi Modern dimana sistem pengelolaan dan pengolahan data lebih mudah dan bersifat dinamis secara online. Tentunya terdapat beberapa tools materi tambahan yang sedang familiar untuk kebutuhan business yaitu Google My Business. Selama pembelajaran berlangsung peserta sangat antusias dalam mengikuti setiap materi yang diberikan, dan diharapkan juga dalam pelatihan kali ini bisa bermanfaat untuk kedepannya.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Sudah lebih dari&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">1.600 Orang</strong>&nbsp;mengikuti Kursus dan Pelatihan bersama kami. Segera Booking Kelas &amp; Jadwal untuk mendapatkan Trainer Terbaik. Langsung aja hubungi&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Customer Service Officer</strong>&nbsp;kami via Whatsapp di&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131314040</strong>&nbsp;(Ayu) atau&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131310210</strong>&nbsp;(Dhea).</p>', 'Publish', 'Konten Kreator', '', '2021-11-08 14:13:00', '0000-00-00 00:00:00'),
(37, 'upload/gambar/Berbagi-Bersama-di-Perayaan-Anniversary-6-Tahun-Creative-Media.jpg', 'Creative Media Berbagi di Anniversary 6 Tahun bersama Yatim Piatu', '<p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Creative Media</strong>&nbsp;merupakan perusahaan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Digital Agency &amp; IT Consultant&nbsp;</strong>yang berdiri sejak tahun 2014, kami memiliki 3 kantor di Surabaya yang berada di Jl. Tubanan Baru 10/ K-15, Surabaya sebagai Head Office sedangkan untuk Branch Office berada di Jl. Nginden Intan Timur XVIII/A3-10, Surabaya, Selain di Surabaya Creative Media juga ada di Kota Tuban tepatnya berada di Jl. Sidomulyo 12 No. 118, Tuban.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Dalam rangka memperingati berdirinya&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Creative Media</strong>&nbsp;yang sudah 6 tahun berkiprah di dunia pendidikan. Di tengah pandemi yang sedang terjadi ini kami diberi kesempatan untuk bisa berbagi bersama adik- adik kami yang ada di<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">&nbsp;Panti Asuhan Tunas Yatim Sejahtera</strong>&nbsp;Surabaya. Kedatangan kami disambut dengan antusias dan gembira oleh adik adik beserta&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pengurus Panti Asuhan Yatim Sejahtera</strong>. Semoga dengan kedatangan kami dan apa yang kami berikan bisa bermanfaat dan berguna untuk adik-adik dan Panti Asuhan. Tentunya semua ini tidak lepas dari kepercayaan customer kami, sehingga kami bisa berekspansi hingga saat ini dan selalu berupaya dalam memberikan fasilitas dan memberikan pelayan terbaik.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Kami ucapkan terima kasih banyak kepada semua Customer setia kami yang sudah memberikan kepercayaan kepada kami dalam pembelajaran berupa Kursus dan Pelatihan di bidang IT Multimedia. Kami berharap meskipun di Era Pandemi Covid 19 ini kami mampu bertahan dan memfasilitasi siswa/siswa dalam pembelajaran melalui Kursus dan Pelatihan secara Tatap Muka dengan Protokel Kesehatan yang Ketat.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Tentunya di Usia 6 tahun ini kami berharap&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\"><a href=\"https://www.facebook.com/wecreativemedia\" target=\"_blank\" rel=\"noreferrer noopener\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: royalblue; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\">Creative Media</a></strong>&nbsp;bisa menjadi&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Lembaga Pendidikan Non Formal</strong>&nbsp;yang dapat berkembang lebih baik lagi dan bisa menjadi wadah serta Inkubator bagi yang ingin mengembangkan skill IT maupun Multimedia, semoga ilmu yang kami berikan selama ini bisa bermanfaat untuk jenjang karir dan menunjang masa depan lebih baik lagi.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Segera Daftar Kursus atau Pelatihan karena kuota kelas terbatas, kami menyediakan 15 bidang studi yang bisa Anda pilih sesuai dengan kebutuhan, tentunya dengan Trainer yang berpengalaman di bidangnya. Langsung aja kamu bisa hubungi Customer Service kami via Whatsapp di 082131314040 (Ayu) atau 082131310210 (Dhea).</p>', 'Publish', 'Konten Kreator', '', '2021-11-13 08:54:20', '0000-00-00 00:00:00'),
(38, 'upload/gambar/Training-Desain-Grafis-Editing-Video-1.jpg', 'Pelatihan Desain Grafis & Editing Video Bersama KPPBC Tipe Madya Pabean A Pasuruan', '<p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Bea Cukai</strong>&nbsp;adalah nama dari sebuah instansi pemerintah yang melayani masyarakat di bidang kepabeanan dan cukai. Pada masa penjajahan Belanda, bea dan cukai sering disebut dengan istilah&nbsp;<em style=\"border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">douane</em>. Seiring dengan era globalisasi, bea dan cukai sering menggunakan istilah customs. Salah satu kantor&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\"><a href=\"http://bcpasuruan.com/\" target=\"_blank\" rel=\"noreferrer noopener\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: royalblue; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\">KPPBC Tipe Madya Pabean A</a></strong>&nbsp;yang ada di Pasuruan mempercayakan kebutuhan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Desain Grafis &amp; Editing Video</strong>&nbsp;ke&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Creative Media</strong>.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Desain Grafis</strong>&nbsp;atau&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">rancang grafis</strong>&nbsp;adalah proses komunikasi menggunakan elemen visual, seperti tipografi, fotografi, serta ilustrasi yang dimaksudkan untuk menciptakan persepsi akan suatu pesan yang disampaikan. Bidang ini melibatkan proses komunikasi visual dan desain komunikasi. Desainer grafis membuat dan mengkombinasikan simbol, gambar, dan teks untuk membentuk representasi gagasan dan pesan secara visual. Desainer grafis menggunakan teknik tipografi, seni rupa, dan tata letak halaman untuk membuat komposisi visual. Penggunaan umum dari desain grafis adalah seperti desain perusahaan (logo dan merek), desain editorial (majalah, surat kabar, dan buku), desain lingkungan, periklanan, desain web, desain komunikasi, dan kemasan produk. [<a href=\"https://id.wikipedia.org/\" target=\"_blank\" rel=\"noreferrer noopener\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: royalblue; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\">wikipedia</a>]</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pelaksanaan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Desain Grafis &amp; Editing Video&nbsp;</strong>berjalan selama 4 hari yaitu dibagi menjadi 2 Sesi diantaranya pada tanggal 09 s.d 10 November 2020 adalah bidang studi&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Desain Grafis</strong>, sedangkan pada tanggal 17 -18 November 2020 merupakan bidang studi&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Editing Video</strong>.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Bagi Anda yang membutuhkan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kursus &amp; Pelatihan</strong>&nbsp;dibidang IT atau Multimedia. Kami memiliki 15 bidang studi IT &amp; Multimedia unggulan yang mampu menjawab kebutuhan Anda. Konsultasikan kebutuhan Anda, jangan pernah ragu untuk hubungi Customer Service kami via Whatsapp di 082131314040 (Ayu) atau 082131310210 (Dhea).</p>', 'Publish', 'Konten Kreator', '', '2021-11-13 08:55:19', '0000-00-00 00:00:00'),
(39, 'upload/gambar/Training-Digital-Marketing-1.jpg', 'Pelatihan Digital Marketing Bersama LP3M UPN Veteran Surabaya', '<p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">LP3M UPN Veteran Jatim adalah salah satu Universitas terkemuka yang ada di Surabaya Jawa Timur, dan LP3M atau Lembaga Pengembangan Pembelajaran dan Penjaminan Mutu mempunyai tugas melaksanakan, mengkoordinasikan, memantau, dan mengevaluasi kegiatan pengembangan pembelajaran dan penjaminan mutu. Kali ini LP3M UPN Veteran Surabaya mempercayakan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Creative Media</strong>&nbsp;untuk melaksanakan program&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Digital Marketing</strong>.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Digital marketing&nbsp;</strong>merupakan suatu kegiatan pemasaran atau promosi sebuah brand atau produk menggunakan media digital atau internet. Tujuan digital marketing adalah untuk menarik konsumen dan calon konsumen secara cepat. Seperti yang kita tahu, penerimaan teknologi dan internet di masyarakat sangat luas sehingga tidak heran kegiatan pemasaran secara digital dijadikan pilihan utama oleh perusahaan-perusahaan. Akibatnya, perusahaan saling berkompetisi membuat konten yang menarik untuk ditampilkan dalam pemasarannya di dunia maya. [<a href=\"https://www.jurnal.id/id/blog/mengenal-digital-marketing-konsep-dan-penerapannya/\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: royalblue; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\"><em style=\"border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">jurnal.id</em></a>]</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada Pelatihan kali ini diikuti oleh 3 peserta yaitu&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Bpk. Agus Setyawan, S.Kom</strong>.,&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Bpk. Abijanto Dahlan, S.Sos</strong>., dan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Ibu Nur Aini Noviana Ayu</strong>, pelatihan dilaksanakan di&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kantor Cabang Creative Media</strong>&nbsp;di Jl. Nginden Intan Timur XVIII/A3-10 Surabaya selama 4 hari pada tanggal 08 s.d 11 Maret 2021.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Digital Marketing</strong>&nbsp;dibimbing langsung oleh Trainer kami yaitu&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Bpk. Frangky Rawung</strong>&nbsp;yang memang ahli dibidangnya, tidak hanya sekedar teori namun peserta dibimbing langsung untuk melakukan penerapan dan praktek pada keilmuwan Digital Marketing. Peserta tampak antusias dalam mengikuti pelatihan dan bersyukur Pelatihan berjalan dengan lancar hingga selesai.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Sudah lebih dari&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">1.600 Orang</strong>&nbsp;mengikuti Kursus dan Pelatihan bersama kami. Segera Booking Kelas &amp; Jadwal untuk mendapatkan Trainer Terbaik. Langsung aja hubungi&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Customer Service Officer</strong>&nbsp;kami via Whatsapp di&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131314040</strong>&nbsp;(Ayu) atau&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131310210</strong>&nbsp;(Dhea).</p>', 'Publish', 'Konten Kreator', '', '2021-11-13 08:56:21', '0000-00-00 00:00:00'),
(40, 'upload/gambar/Pelatihan-Desain-Poster.png', 'Creative Media Sebagai Narasumber Dalam Pelatihan Desain Poster & Seni Foto di Universitas Terbuka Surabaya', '<p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Universitas Terbuka (UT) adalah Perguruan Tinggi Negeri ke-45 di Indonesia yang diresmikan pada tanggal 4 September 1984, berdasarkan Keputusan Presiden RI Nomor 41 Tahun 1984. UT memiliki 4 Fakultas, yaitu Fakultas Ekonomi (FE), Fakultas Hukum, Ilmu Sosial dan Ilmu Politik (FHISIP), Fakultas Sains dan Teknologi (FST), Fakultas Keguruan dan Ilmu Pendidikan (FKIP) untuk jenjang Diploma dan Sarjana. Sejak tahun 2004, UT membuka jenjang Magister pada Program Pascasarjana. Sejak tahun 2019, UT membuka program Doktor. Pada kali ini Creative Media berkesempatan untuk mengisi Pelatihan Desain Poster dan Seni Foto.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Desain Poster&nbsp;adalah karya seni atau desain grafis yang memuat komposisi&nbsp;gambar dan huruf di atas kertas berukuran besar atau kecil. Pengaplikasiannya dengan ditempel di dinding atau permukaan datar lainnya dengan sifat mencari perhatian mata sekuat mungkin. Karena itu poster biasanya dibuat dengan warna-warna kontras dan kuat. Poster bisa menjadi sarana iklan, Pendidikan, propaganda, sosialisasi dan dekorasi. Selain itu bisa pula berupa Salinan karya seni terkenal [<a href=\"https://id.wikipedia.org/wiki/Poster#:~:text=Poster%20adalah%20karya%20seni%20atau,mencari%20perhatian%20mata%20sekuat%20mungkin.\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: royalblue; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\">Wikipedia.org</a>]</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada tanggal 06 Juni 2021 Creative Media menjadi narasumber dalam Pelatihan Desain Poster dan Seni Foto di Universitas Terbuka Tuban, dalam pelatihan yang berlangsung selama 6 jam ini diwakili oleh Bpk. Hadi Sisyanto dan Bpk. Kemal Khoirul Rohman dalam mengisi pelatihan tersebut.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pelatihan Desain Poster dan Seni Foto kali ini diikuti oleh 20-30 peserta, mereka adalah Mahasiswa bidikmisi yang pada tahun ini akan mengikuti lomba nasional yang diadakan oleh Universitas Terbuka, dan software yang mereka gunakan dalam pelatihan ini adalah Adobe Photoshop dan CorelDraw. Mereka sangat antusias dalam mengikuti pelatihan kali ini, tak hanya materi saja yang diberikan mereka juga diajak langsung untuk praktek menggunakan software yang digunakan. Diharapkan dengan andanya pelatihan ini bisa menjadi bekal untuk mereka kedepannya.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Sudah lebih dari&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">1.600 Orang</strong>&nbsp;mengikuti Kursus dan Pelatihan bersama kami. Segera Booking Kelas &amp; Jadwal untuk mendapatkan Trainer Terbaik. Langsung aja hubungi&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Customer Service Officer</strong>&nbsp;kami via Whatsapp di&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131314040</strong>&nbsp;(Ayu) atau&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131310210</strong>&nbsp;(Dhea).</p>', 'Publish', 'Konten Kreator', '', '2021-11-13 08:57:21', '0000-00-00 00:00:00'),
(41, 'upload/gambar/Pelatihan-Pemrograman-Web-1024x379.jpg', 'Pelatihan Pemrograman Web Bersama Kantor Bea Cukai Denpasar – Bali', '<p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Kantor&nbsp;<a href=\"https://bcngurahrai.beacukai.go.id/\" target=\"_blank\" rel=\"noreferrer noopener\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: royalblue; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\">Pengawasan dan Pelayanan Bea dan Cukai Tipe Madya Pabean A Denpasar</a>&nbsp;terbentuk berdasarkan Keputusan Direktur Jenderal Bea dan Cukai Nomor KEP-65/BC/2015 tanggal 01 April 2015 tentang Pembentukan Kantor Pengawasan dan Pelayanan Bea dan Cukai Tipe Madya Pabean A Denpasar dan Penghapusan Kantor Pengawasan dan Pelayanan Bea dan Cukai Tipe Pratama Benoa. Pada tanggal 24 Maret 2016, Direktur Jenderal Bea dan Cukai, Bapak&nbsp;Heru Pambudi, meresmikan pemakaian gedung Kantor Pengawasan Bea dan Cukai Tipe Madya Pabean A Denpasar yang berlokasi di Jalan Raya Tukad Badung, Renon, Denpasar.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada kesempatan kali ini Kantor Pengawasan dan Pelayanan Bea dan Cukai Tipe Madya Pabean A Denpasar memberikan kepercayaan kepada Lembaga Kursus dan Pelatihan Creative Media Surabaya dalam melaksanakan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Pemrograman Web</strong>.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\"><em style=\"border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Web Programming</em>&nbsp;atau Pemrograman Web merupakan istilah yang erat kaitannya dengan internet dan&nbsp;<em style=\"border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">website</em>. Memang benar, karena pemrograman web merupakan suatu proses pembuatan&nbsp;<em style=\"border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">website</em>&nbsp;untuk keperluan internet. Orang banyak mengenal web dengan istilah WWW atau&nbsp;<em style=\"border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">World Wide Web</em>.&nbsp;<em style=\"border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">World Wide Web</em>&nbsp;adalah halaman-halaman&nbsp;<em style=\"border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">website</em>&nbsp;yang terkoneksi satu dengan lainnya atau disebut juga dengan&nbsp;<em style=\"border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">hyperlink</em>&nbsp;yang membentuk samudera informasi yang berjalan dengan protokol&nbsp;<em style=\"border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">HyperText Transfer Protocol</em>&nbsp;(HTTP).</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Kantor Bea Cukai yang berlokasi di Jalan Raya Tukad Badung, Renon, Denpasar ini melaksanakan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Pemrograman Web</strong>&nbsp;selama 5 hari yaitu pada tanggal 14 s.d 18 Juni 2021 dengan protokol kesehatan yang ketat dan dilaksanakan langsung secara offline di Kantor Pengawasan dan Pelayanan Bea dan Cukai Tipe Madya Pabean A Denpasar – Bali.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Pemrograman Web</strong>&nbsp;kali ini dibimbing langsung oleh Bpk. M. Wahyu Sugiarto yang sudah berpengalaman dalam Development sistem informasi &amp; website. Pelatihan diikuti oleh 21 peserta yang dibagi menjadi 2 bagian, 11 peserta Pelatihan secara offline yang bertatap muka langsung dengan trainer sedangkan 10 peserta lainnya secara online, baik secara offline ataupun online mereka mendapat materi yang sama karena mereka dibimbing secara bersamaan. Mereka sangat antusias dalam mengikuti pelatihan kali ini, tak hanya materi saja yang diberikan mereka juga diajak langsung praktik dalam development sistem website.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Sudah lebih dari&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">3.000 orang</strong>&nbsp;mengikuti Kursus dan Pelatihan bersama kami. Segera Booking Kelas &amp; Jadwal untuk mendapatkan Trainer Terbaik kami. Silahkan menghubungi&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Customer Service Officer</strong>&nbsp;kami via Whatsapp di&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131314040</strong>&nbsp;(Ayu) atau&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131310210</strong>&nbsp;(Dhea).</p>', 'Publish', 'Konten Kreator', '', '2021-11-13 08:59:33', '0000-00-00 00:00:00'),
(42, 'upload/gambar/Pelatihan-Digital-Marketing.png', 'Pelatihan Digital Marketing Bersama Universitas PGRI Adi Buana Surabaya', '<p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada kesempatan kali ini Universtas PGRI Adi Buana bekerjasama dengan Lembaga Kursus &amp; Pelatihan Creative Media Surabaya untuk melaksanakan kegiatan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Digital Marketing</strong>&nbsp;secara Online yang di ikuti oleh 60 Peserta dari Kalangan Mahasiswa yang difilter dari berbagai jurusan yang tersedia. Tren Digital Marketing saat ini mulai dikenal di kalangan masyarakat, terutama bagi para pelaku bisnis. Kemudahan serta efektivitas pun menjadi alasan kenapa mereka memilih untuk mulai beralih ke digital. Tapi apa sebenarnya Digital Marketing itu?, apa saja yang akan di pelajari dikeilmuwan itu. Digital marketing adalah suatu aktivitas promosi, baik untuk mempromosikan sebuah brand, produk maupun menggunakan media digital. [<a href=\"https://sasanadigital.com/apa-yang-dimaksud-dengan-digital-marketing/\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: royalblue; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\">sasanadigital.com</a>]. Materi yang akan di kupas tuntas ollen Trainer kami meliputi 6 genis digital marketing yaitu Website, Search Engine Marketing, Social Media Marketing, Online Advertising, Email Marketing &amp; Video Marketing sera tools-tools pendukung digital marketing lainnya.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada kesempatan kali ini kampus yang berada di Jl. Dukuh Menanggal ini melaksanakan pelatihan secara online dengan tema “Developing Digital &amp; Social Media Strategies for Business 4.0”, dan dilaksanakan selama 2 hari pada 22-23 Juli 2021.&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Digital Marketing</strong>&nbsp;diikuti sekitar 60 peserta yang merupakan Mahasiswa/i UNIPA dari beberapa jurusan. Kebijakan yg telah ditetapkan oleh pemerintah terkait penanganan pandemi yaitu PPKM Darurat Jawa Bali mengharuskan kita untuk mengurangi mobilitas diluar rumah. Sehingga beberapa kegiatan atau agenda offline/tatap muka harus ditiadakan sementara waktu untuk menghindari kerumunan. Namun kebijakan tersebut tidak mengurai semangat rekan-rekan mahasiswa Universitas Adi Buana Surabaya untuk mengikuti Pelatihan secara daring/online.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Semangat mahasiswa dalam acara Workshop tau Pelatihan “Developing Digital &amp; Social Media Strategies for Business 4.0” Universitas Adi Buana Surabaya antusias sangat luar biasa. Pelatihan ini dilakukan secara daring dengan materi Penerapan Digital Marketing &amp; Social Media For Business yang bisa dipraktekkan secara langsung dari rumah masing-masing dan dimonitor secara online mulai dri Keilmuwan Digital Marketing, penggunaan Facebook Business, Facebook Business Suite, Facebook Ads, Instagram Business, Optimasi pada Instagram Bisnis, Instagram Ads, Strategi di Google My Business, Google Ads, SEO, SMO, SEM, SMM dan Landing page Website.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Digital Marketing</strong>&nbsp;kali ini dibimbing langsung oleh Bpk. Hadi Sisyanto yang sudah berpengalaman dibidangnya dan beliau merupakan Founder dan CEO dari Creative Media Surabaya, para peserta sangat menikmati dengan adanya pelatihan ini. Selain itu tak hanya materi praktek saja yang diberikan pada akhir sesi para peserta diajak untuk bermain game dan para pemenang berhak mendapatkan hadiah special dari Creative Media.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Semoga Ilmunya bermanfaat serta membawa dampak perubahan kemajuan yang signifikan dalam membangun Bisnis/Usaha yang sedang dirintis maupun dikembangkan rekan-rekan mahasiswa/i.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Sudah lebih dari&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">3000 orang</strong>&nbsp;mengikuti Kursus dan Pelatihan bersama kami. Segera Booking Kelas &amp; Jadwal untuk mendapatkan Trainer Terbaik. Info lebih lanjut, silahkan langsung aja hubungi&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Customer Service Officer</strong>&nbsp;kami via Whatsapp di&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131314040</strong>&nbsp;(Ayu) atau&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131310210</strong>&nbsp;(Dhea).</p>', 'Publish', 'Konten Kreator', '', '2021-11-13 09:01:24', '0000-00-00 00:00:00'),
(43, 'upload/gambar/Pelatihan-Desain-Grafis-Digital-Marketing.jpg', 'Pelatihan Digital Marketing & Desain Grafis Bersama SMK PGRI 1 Kota Kediri', '<p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">SMK PGRI 1 Kota Kediri di dirikan pada tahun 1984 dibawah binaan Yayasan Pembina Lembaga Pendidikan PGRI Kota Kediri. Dipimpin oleh Bapak Drs. Joko Sutrisno. Membuka tiga jurusan yaitu: Mesin Tenaga, Instalasi Listrik dan Bangunan Gedung. Luas tanah milik SMK PGRI 1 Kota Kediri seluas 5000m2, pada tahun 1990 dibangun Gedung bertingkat dua dengan swasembada murni, itulah sedikit sejarah tentang SMK PGRI 1 Kota Kediri dan saat ini mengundang Creative Media untuk melaksanakan kegiatan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Digital Marketing &amp; Desain Grafis</strong>.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Desain grafis&nbsp;atau&nbsp;rancang grafis&nbsp;adalah proses komunikasi menggunakan elemen visual, seperti tipografi, fotografi, serta ilustrasi&nbsp;yang dimaksudkan untuk menciptakan persepsi akan suatu pesan yang disampaikan. Bidang ini melibatkan proses komunikasi visual dan desain komunikasi. [<a href=\"https://id.wikipedia.org/wiki/Desain_grafis\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: royalblue; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\">Wikipedia.org</a>]</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Sedangkan Digital Marketing adalah suatu aktivitas promosi, baik untuk mempromosikan sebuah&nbsp;<em style=\"border: 0px; font-family: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">brand</em>, produk maupun jasa menggunakan media digital. [<a href=\"https://sasanadigital.com/apa-yang-dimaksud-dengan-digital-marketing/\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: royalblue; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\">sasanadigital.com</a>]</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Sekolah yang terletak di Jl. Penanggungan No. 2 Kota Kediri ini melaksanakan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Digital Marketing &amp;&nbsp;</strong><strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Desain Grafis</strong>&nbsp;selama 8 hari untuk 2 bidang studi, yaitu untuk Desain Grafis (CorelDRAW &amp; Adobe Photoshop) dilaksanakan pada tanggal 25-26 September &amp; 2-3 Oktober 2021 sedangkan untuk Digital Marketing (SEM, SEO, SMM, Landing Page Website, Online Advertising, Email Marketing, Google Business &amp; Video Marketing) dilaksanakan pada tanggal 27-30 September 2021.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Pada&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Digital Marketing &amp; Desain Grafis</strong>&nbsp;dibimbing langsung oleh Trainer Profesional kami yang ahli dibidangnya. Desain Grafis dibimbing oleh Bpk. M. Akbar B. sedangkan untuk Digital Marketing dibimbing oleh Bpk. Hadi Sisyanto. Mereka sangat antusias dalam melaksanakan Pelatihan kali ini karena tak hanya materi berupa teori saja yang diberikan, mereka juga langsung mempraktekkan keilmuwan menggunakan software yang diberikan.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Sudah lebih dari&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">3.000 orang</strong>&nbsp;mengikuti Kursus dan Pelatihan bersama kami. Segera Booking Kelas &amp; Jadwal untuk mendapatkan Trainer Terbaik kami. Silahkan menghubungi&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Customer Service Officer</strong>&nbsp;kami via Whatsapp di&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131314040</strong>&nbsp;(Ayu) atau&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131310210</strong>&nbsp;(Dhea).</p>', 'Publish', 'Konten Kreator', '', '2021-11-13 09:11:17', '0000-00-00 00:00:00'),
(44, 'upload/gambar/Pelatihan-Editing-Video.jpg', 'Pelatihan Editing Video Bersama Dinas Kesehatan Kabupaten Jombang', '<p class=\"has-text-align-justify\" style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Dinas Kesehatan merupakan unsur pelaksana otonomi daerah di bidang kesehatan yang berkedudukan di bawah dan bertanggung jawab kepada Bupati melalui Sekretaris Daerah. Dinas Kesehatan mempunyai tugas pokok melaksanakan urusan pemerintahan daerah bidang kesehatan berdasarkan asas otonomi daerah dan tugas pembantuan Dinas Kesehatan. Dan pada kesempatan kali ini Dinas Kesehatan Kabupaten Jombang bekerjasama dengan Lembaga Kursus &amp; Pelatihan Creative Media Surabaya untuk melaksanakan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Editing Video</strong>&nbsp;di Dinas Kesehatan Kabupaten Jombang.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Apa sih Editing Video itu? Editing Video adalah suatu proses panjang dari pembuatan suatu video dimulai dari penyeleksian, penambahan meta teks/judul, variasi, transisi/perpindahan, effect yang dihasilkan, pemilihan lagu, sound effect, dan narasi, hingga mewarnai suatu hasil rekaman gambar mentah menjadi sebuah video yang mempunyai tampilan dan format video yang dibutuhkan untuk ditayangkan pada kebutuhan tertentu. [<a href=\"https://rekreartive.com/pengertian-apa-itu-editing-video-aplikasi-nya/\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: royalblue; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; transition: all 700ms ease 0s;\">recreative.com</a>]</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Kantor yang beralamatkan di Jl. Dr. Soetomo No. 75 Sengon, Kepanjen, Kec. Jombang, Kab. Jombang ini melaksanakan&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Editing Video</strong>&nbsp;selama 3 hari yaitu pada tanggal 28 s.d 30 September 2021, Dinas Kesehatan Kab. Jombang menugaskan 12 staff sebagai peserta untuk mengikuti Pelatihan Videography (Adobe Premiere &amp; Adobe After Effects).</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Saat ini keilmuwan dan keahlian Videography sangam di butuhkan beriringan dengan perkembangan Teknologi dan Digital Marketing yang sedang tren saat ini. Sehingga staff maupun karyawan dituntut untuk bisa mengikuti perkembangan teknologi dan kampanye digital. Pada&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pelatihan Editing Video</strong>&nbsp;kali ini peserta diberikan tips dalam take video, editing video hingga rendering, dibimbing oleh Trainer profesional kami yang memang ahli dibidangnya yaitu Bpk. Miftah Walid, beliau berpengalaman di Videografi sehingga peserta dengan mudah menangkap materi berupa teori dan prakting selama Pelatihan Editing Video berjalan.</p><p style=\"margin-bottom: 24px; border: 0px; font-family: Lato, sans-serif; font-size: 16px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(64, 64, 64);\">Sudah lebih dari&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">3.000 orang</strong>&nbsp;mengikuti Kursus dan Pelatihan bersama kami. Segera Booking Kelas &amp; Jadwal untuk mendapatkan Trainer Terbaik. Untuk informasi lebih lanjut, silahkan menghubungi&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Customer Service Officer</strong>&nbsp;kami via Whatsapp di&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131314040</strong>&nbsp;(Ayu) atau&nbsp;<strong style=\"border: 0px; font-family: inherit; font-style: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">082131310210</strong>&nbsp;(Dhea).</p>', 'Publish', 'Konten Kreator', '', '2021-11-13 09:13:23', '0000-00-00 00:00:00');
INSERT INTO `bidang_studi` (`id_studi`, `nama_studi`, `deskripsi`, `gambar`, `harga`, `created_by`, `updated_by`, `created_date`, `updated_date`) VALUES
(4, 'Komputer Umum & Internet', 'Menguasai Komputer Umum & Internet secara keseluruhan sangatlah penting dan diperlukan dalam kehidupan sehari-hari karena Teknologi saat ini berkembang pesat. Dengan berkembangnya teknologi, saat ini Kursus Komputer Surabaya menyebar luas dikalangan muda hingga lanjut usia. Untuk itu dalam menghadapi persaingan global pada tahap informasi dan teknologi,        ', 'upload/gambar/kursus-komputer-surabaya.jpg', '2000000', '0000-00-00 00:00:00', 'Admin Creative Media', '2018-11-27 08:54:16', '2019-01-18 13:33:00'),
(5, 'Website Blog', '<p style=\"text-align: justify; \"><font color=\"#404040\" face=\"Lato, sans-serif\"><span style=\"font-size: 12px;\">Kalau hanya membuat Website Blog saja kami yakin banyak orang yang bisa, tapi pertanyaannya “Bagaimana Cara Membuat Website Sendiri secara Gratis tampilan Powerfull ?“. Pada bidang studi “Website Blog” ini anda dapat membuat Website menggunakan Blogspot dan Worpress dengan tampilan Menarik dan Powerfull tidak seperti Blog-blog pada umumnya dengan tampilan sederhana. Karena anda akan dibekali beberapa Teknik editing konten HTML yang ada di Web Blog tersebut sehingga tampilan lebih Menarik dan Profesional sehingga mempunyai nilai Citra Positif untuk pengembangan Bisnis Anda.</span></font><br></p>', 'upload/gambar/website-blog.jpg', '', 'Admin Creative Media', '', '2018-12-03 05:47:40', '0000-00-00 00:00:00'),
(6, 'Administrasi Perkantoran', '<p style=\"text-align: justify; \"><font color=\"#404040\" face=\"Lato, sans-serif\"><span style=\"font-size: 12px;\">Program Kursus Administrasi Perkantoran ini sangat cocok bagi anda lulusan SMA/K, Mahasiswa, Guru, Staff Perusahaan, Pegawai Negeri Sipil (PNS), Pebisnis Online, Karyawan swasta dll. Khususnya yang ingin mempelajari lebih dalam Software yang digunakan dalam kegiatan Administrasi Perkantoran yang ada di Perusahaan. Kursus Administrasi Perkantoran berfokus pada penguasaan Software Microsoft Office (Ms. Excel, Ms. Word, Ms. Power Point &amp; Outlook). Staff Administrasi Perkantoran sangat dibutuhkan di Perusahaan guna membantu mengelola dan mengolah serta manajemen data yang ada di perusahaan, sehingga lebih Efektif dan Efisien.</span></font><br></p>', 'upload/gambar/administrasi-perkantoran-ok.jpg', '', 'Admin Creative Media', '', '2018-12-03 05:50:17', '0000-00-00 00:00:00'),
(7, 'Komputer Akuntansi', '<p style=\"text-align: justify; \"><font color=\"#404040\" face=\"Lato, sans-serif\"><span style=\"font-size: 12px;\">Program bidang studi Komputer Akuntansi kami khususkan bagi Anda yang ingin Kursus Akuntansi yaitu mempelajari software accounting (Myob Accounting, Zahir Accounting, Accurate Accounting ataupun Excel Accounting). Banyak tempat kursus yang menyediakan bidang studi Komputer akuntansi atau MYOB sebagai materi pembelajaran, namun materi yang disajikan sangatlah Dasar sehingga belum sesuai dengan yang kita harapkan. Hal tersebut akan membuang waktu dan biaya secara percuma, untuk memenuhi kebutuhan tersebut Creative Media hadir dengan bidang studi Komputer Akuntasi Keuangan Profesional yang terdiri dari 2 kelas yaitu Professional Class dan Executive Class. Untuk mengetahui perbedaan antara Professional Class dan Executive Class, Anda dapat mempelajari perbedaan dimasing masing kelas pada halaman About Us.</span></font><br></p>', 'upload/gambar/Kursus-Komputer-Akuntansi-Akuntansi-MYOB-Les-Akuntansi-Kursus-Akuntansi-Surabaya-Les-Akutansi-Surabaya-02.jpg', '', 'Admin Creative Media', '', '2018-12-03 05:51:57', '0000-00-00 00:00:00'),
(8, 'Desain Grafis', '<p style=\"margin-bottom: 24px; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; text-align: justify;\"><font color=\"#404040\" face=\"Lato, sans-serif\"><span style=\"font-size: 12px;\">Seperti yang kita tahu bahwa keilmuwan Graphic Design sangat dibutuhkan di Era Global seperti saat ini, 99% teknik promo secara visual menggunakan keilmuwan Graphic Design. Untuk itu tidak salah lagi bidang studi Desain Grafis menjadi Primadona yaitu bidang studi terfavorit ditahun 2016. Siswa dan peserta kursus pada bidang studi ini datang dari berbagai latar belakang dan profesi, mulai dari lulusan SMA/K, Mahasiswa, Karyawan Swasta, Owner Bisnis hingga kalangan Dokter. Kini saatnya giliran Anda belajar desain grafis bersama kami. Untuk tingkatan pada bidang studi ini, kami mempunyai 2 level yaitu level Basic dan level Advanced.</span></font></p><p style=\"margin-bottom: 24px; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; text-align: justify;\"><font color=\"#404040\" face=\"Lato, sans-serif\"><span style=\"font-size: 12px;\"><br></span></font></p><p style=\"margin-bottom: 24px; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; text-align: justify;\"><font color=\"#404040\" face=\"Lato, sans-serif\"><span style=\"font-size: 12px;\">Tips dan trik pada keilmuwan Desain Grafis (seorang Desainer) dalam menciptakan sebuah karya komunikasi visual yang menarik, tentunya indah dilihat akan dikupas jika Anda belajar Desain Grafis bersama kami. Jadi bagi Anda yang ingin belajar Desain Grafis secara singkat dengan jadwal yang fleksibel, kami adalah solusi Cerdas dan Tepat dalam Desain Grafis Anda. Pada bidang studi ini akan diajarkan “Bagaimana cara mendesain yang benar?” serta arah dan tujuan dari karya visual yang kita buat agar bisa diterima oleh Client/Perusahaan. Dengan Desain yang Menarik, Informatif dan Kreatif akan mampu berbicara dalam menyampaikan pesan secara Visual. Oleh sebab itu bagi Anda yang ingin belajar Desain Grafis, saatnya Anda bergabung dengan kami, untuk menguak rahasia dibalik keilmuwan Desain Grafis.</span></font></p>', 'upload/gambar/Les-Privat-Desain-Grafis-Creative-Media.png', '', 'Admin Creative Media', '', '2018-12-03 05:53:44', '0000-00-00 00:00:00'),
(9, 'Desain Interior', '<p>Bidang Studi <font color=\"#ff9c00\" style=\"background-color: inherit;\">Desain Interior</font> adalah salah satu bidang studi keilmuan yang didasarkan pada penggabungan ilmu <b>Desain</b> dan <b>Interior</b> atau paling populer <b>Desain Interior Rumah</b>. Bidang studi <b>Desain Interior</b> ini bertujuan untuk menciptakan suatu lingkungan binaan (ruang dalam) yang fungsional sesuai dengan kebutuhan individu beserta elemen-elemen pendukungnya, baik fisik maupun non-fisik, sehingga kualitas kehidupan manusia yang berada didalamnya nyaman. Ada tiga hal utama yang menjadi kajian dalam <b>Desain Interior Rumah</b> yaitu ruang, alat fungsional dan manusia penggunanya.</p><p>Dalam mempelajari<b> Desain Interior Rumah</b> diperlukan penguasaan sejumlah pengetahuan yang berkaitan dengan aspek kebutuhan manusia di dalam ruang sebagai makhluk individual maupun sosial. Pengetahuan yang dimaksud mencakup: sejarah<b> desain, psikologi, sosiologi, ergonomi, konstruksi bangunan, fisika teknik, metodologi dan estetika.</b> Selain pemahaman terhadap pengetahuan yang mendukung diperlukan juga penguasaan keterampilan dalam proses perancangan<b> Desain Interior Rumah</b> antara lain kemampuan membuat program, kemampuan membuat presentasi desain, kemampuan komunikasi dan sebagainya.</p>                ', 'upload/gambar/Kursus-Desain-Interior-di-Surabaya-01.jpg', '', 'Admin Creative Media', 'Admin Creative Media', '2019-02-12 11:40:08', '2019-03-25 20:41:25'),
(10, 'Desain Arsitektur', '<p>Perkembangan desain bangunan saat ini yang sangat indah, berseri serta megah yang sering kita jumpai khususnya di kota-kota besar Jakarta, Surabaya dan sekitarnya, mungkin ketika itu pikiran kita akan melayang pada suatu kata yaitu \"Arsitek\". Sangat benar kata Arsitek ketika sudah menempuh dan menyelesaikan pendidikan formal maupun non-formal di bidang studi<b> Desain Arsitektur</b>. Tentunya kata<b> Desain Arsitektur</b>&nbsp; tidak lepas dari kata perancangan dan desain sebuah bangunan dan ruang.</p><p>Sebuah ruang yang baik adalah yang dapat menampung dan mewadahi segala aktivitas di dalamnya. Dengan adanya aktivitas yang terjadi di dalamnya, maka sebuah space dapat dikatakan sudah menjadi place (tempat yang memiliki ruh/spirit kehidupan). Banyak elemen dan unsur yang mampu menciptakan sebuah ruang. Salah satunya contohnya ada pada gambar disamping ini. Sebuah ruang cafe tidak hanya dapat dibentuk oleh lantai marmer, dinding masif, dan atap genteng. Tetapi, ruangan tersebut hanya diciptakan dari sebuah kanopi sederhana dan pagar rendah disekelilingnya.</p><p><b><font color=\"#0000ff\" style=\"background-color: inherit;\">Bangunan</font></b> yang baik haruslah memiliki Keindahan / Estetika (Venustas), Kekuatan (Firmitas), dan Kegunaan /Fungsi (Utilitas); arsitektur dapat dikatakan sebagai keseimbangan dan koordinasi antara ketiga unsur tersebut, dan tidak ada satu unsur yang melebihi unsur lainnya. Dalam definisi modern,<b> Desain Arsitektur</b> harus mencakup pertimbangan fungsi, estetika, dan psikologis. Namun, dapat dikatakan pula bahwa unsur fungsi itu sendiri di dalamnya sudah mencakup baik unsur estetika maupun psikologis.</p><p>Dalam bidang studi<b> Desain Arsitektur</b> ini, materi pembelajaran seputar penggunaan software AutoCAD dan Sketch Up serta penggunaan tools didalamnya. Dalam prosesnya, dan setelah menuntaskan kursus dalam bidang studi ini, siswa diharapkan akan mampu membuat denah rumah sederhana, siswa mampu dalam membuat tampak bangunan di AutoCAD 2D (depan dan samping), mampu membuat potongan bangunan di AutoCAD 2D, perencanaan denah lokasi denah atap, serta perencanaan instalasi dalam rumah lainnya seperti listrik dan saluran air.</p><p>Setelah menyelesaikan pembelajaran bidang studi<b> Desain Arsitektur</b> ini, peserta diharapkan memiliki kemampuan dalam menguasai dasar merancang Arsitektur secara komprehensif (untuk bangunan dengan kompleksitas menengah), mempunyai jiwa semangat dalam berwirausaha, mempunyai kualifikasi nasional, menguasai prinsip arsitektur sadar energi, mempunyai kemampuan mendesain arsitektur (menguasai metode desain, menguasai standard-standard, menguasai peraturan bangunan, menguasai detailed desain, menguasai bahan bangunan, mampu memperhitungkan RAB), dll.</p>                ', 'upload/gambar/architecture-design-wallpaper-ok-.jpg', '', 'Admin Creative Media', 'Admin Creative Media', '2019-02-12 11:50:36', '2019-02-12 13:28:16'),
(11, 'Editing Video Multimedia', '<p>Bidang studi<b>  Kursus Editing Video Multimedia</b>  ini sangat cocok bagi Anda yang ingin mengembangkan kemampuan dalam proses pembuatan atau pengolahan<b> Editing Video Multimedia</b>. Dalam pembelajaran ini materi yang akan Anda pelajari secara umum adalah<b>  Teknik capture video, Edit video, Film dokumenter, Video effect, Transisi effect, Audio editing dan Effect, Tittle video animations, Video rendering, Produksi VCD & DVD,</b>  dan masih banyak lagi yang lainnya. Karena Sistem pembelajaran kami 1 Tentor 1 Siswa, jadi Anda bebas berexplore mengenai materi, materi custom (bisa menyesuaikan kebutuhan siswa). Software yang Anda kuasi pada<b> Kursus Editing Video</b> ini adalah<b> Adobe Premiere, Adobe After Effect,</b> serta software pendukung<b> Editing Video Multimedia</b>  lainnya.</p><p>Dalam pembelajaran<b> Editing Video Multimedia</b> kursus topik yang didapat merupakan bagian dari pengetahuan pembuatan motion graphics dan efek video yang didapat dimanfaatkan untuk kebutuhan Video Editing, Televisi dan Film. Setelah mengikuti kursus Anda akan mampu membuat Project Video (<b>Wedding, Birthday Party, Event Organizer, Video Clip, Film Pendek, Opening, Ending, dll.</b>) dari Camera dengan menarik dan Profesional, Video Edited/Manipulations Special Video Effect dan lain-lain.</p>                ', 'upload/gambar/kursus_editing_video.jpg', '', 'Admin Creative Media', 'Admin Creative Media', '2019-02-12 11:59:37', '2019-02-12 13:16:52'),
(12, 'Pemrograman Web', '<p>Bahasa pemrograman yang akan Anda pelajari dalam bidang studi <b>Pemrograman Web</b> disini yaitu mencakup<b> HTML, PHP, MySQL</b> (database),<b> CSS, Java Script, Framework dan Jquery</b>. Anda akan mempelajari dasar-dasar bahasa <b>Pemrograman Web</b> HTML, PHP, MySQL, CSS dan Jquery, sehingga setelah melewati kursus <b>Pemrograman Web</b> ini Anda akan mampu menerapkan pemrograman yang Anda pelajari dalam pembuatan sebuah <b>Website Dinamis Profesional</b>. Jika Anda pemula yang sama sekali belum pernah mengenal coding / bahasa pemrograman, dengan senang hati Tentor kami akan membimbing Anda SAMPAI BISA. Semua itu didasari demi tercapainya Visi dan Misi yang besar, salah satunya \"Mencerdaskan generasi muda Indonesia menjadi generasi yang berkompeten dan berdaya saing Global sehingga dapat bekerja Mandiri dan Kreatif\".</p><p><br></p><p>Dalam kursus <b>Pemrograman Web</b> ini Anda akan dibimbing langsung oleh <b>Pakar Progamming Web</b> terdiri dari dari Praktisi dan Dosen Profesional yang sudah berpengalaman di Bidang Web Programmer. Sudah banyak project-project besar yang ditangani oleh Tentor kami mulai dari Perusahaan, Pemerintah, UMKM, Dll. Jadi Tentor kami adalah orang yang tepat untuk Anda jadikan pendamping dalam menyelesaikan tumpukan permasalahan <b>Pemrograman Web</b> Anda. Belajar Pemrograman itu sangatlah mudah, tidak seperti yang anda bayangkan saat ini.</p><p><span source=\"\" sans=\"\" pro\",=\"\" sans-serif;=\"\" color:=\"\" rgb(64,=\"\" 64,=\"\" 64);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\">Jika Anda pemula, dalam pembelajaran kursus&nbsp;</span><strong style=\"font-style: inherit; outline: 0px;\"><span source=\"\" sans=\"\" pro\",=\"\" sans-serif;=\"\" color:=\"\" rgb(255,=\"\" 102,=\"\" 0);=\"\" border:=\"\" 1pt=\"\" none=\"\" windowtext;=\"\" padding:=\"\" 0in;=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><span style=\"outline: 0px;\">Pemrograman Web</span></span></strong><span source=\"\" sans=\"\" pro\",=\"\" sans-serif;=\"\" color:=\"\" rgb(64,=\"\" 64,=\"\" 64);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\">&nbsp;ini Anda akan dikenalkan Pengantar bahasa pemrograman\r\nPHP, Struktur PHP, Variable, Tipe data dan konstanta, Submit form (POST/GET),\r\nOperator Aritmatika, Operator assignment, Operator perbandingan, Operator\r\nlogika, Menggunakan variable array, Kondisi (IF, ELSE , SWITCH), Pengulangan\r\n(FOR, WHILE, FOREACH), Membuat fungsi, Mengenal MySQL, Membuat database,\r\nMembuat table database, Perintah SQL, Koneksi Database dengan PHP, Submit form\r\nke database, Menampilkan data dari database, Upload ke hosting.</span><br></p><p class=\"MsoNormal\"><span style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" sans-serif;=\"\" color:=\"\" rgb(64,=\"\" 64,=\"\" 64);=\"\" background-image:=\"\" initial;=\"\" background-position:=\"\" background-size:=\"\" background-repeat:=\"\" background-attachment:=\"\" background-origin:=\"\" background-clip:=\"\" initial;\"=\"\"><o:p>&nbsp;</o:p></span></p><p style=\"margin: 0in 0in 0.25in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"font-family:\" source=\"\" sans=\"\" pro\",sans-serif;color:#404040\"=\"\">Namun jika Anda\r\nsudah menguasai teknik dasar dalam pembuatan Web Standart, maka tentor akan\r\nmengajarkan Anda&nbsp; tentang PHP &amp; MySQL tingkat Profesional. Mengenal\r\ndan menggunakan tag-tag HTML, Membuat dokumen web statis HTML, Manajemen Table,\r\nBullet &amp; numbering, Penggunaan link, Penerapan Color. Penggunaan\r\nproperty-properti CSS tingkat lanjut, JavaScript tingkat lanjut. Konsep OOP\r\ndalan PHP tingkat lanjut, Konfigurasi Database MySQL, Pengenal\r\nperintah-perintah SQL di MySQL untuk tingkat lanjut, HTML : iframe, JavaScript,event\r\ndriven (on Change, on Submit, functions), document object. MySQL: DDL, DML, DCL\r\ndi SQL. PHP : OOP, File System, Regular Expresion, XML, Penggunaan dan\r\npenerapan CSS, Penggunaan dan pengaplikasian Jquery.<o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; outline: 0px;\"><span style=\"font-family:\" source=\"\" sans=\"\" pro\",sans-serif;color:#404040\"=\"\">Setelah\r\nmengikuti kursus&nbsp;</span><span style=\"font-style: inherit; font-weight: inherit; outline: 0px;\"><strong style=\"font-style: inherit; outline: 0px;\"><span style=\"font-family:\" source=\"\" sans=\"\" pro\",sans-serif;=\"\" color:#993366;border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:none=\"\" 0in;=\"\" padding:0in\"=\"\">Pemrograman Web level Advanced</span></strong></span><span style=\"font-family:\" source=\"\" sans=\"\" pro\",sans-serif;color:#404040\"=\"\">&nbsp;Anda akan\r\nmampu membuat&nbsp;<strong style=\"font-style: inherit; outline: 0px;\"><span style=\"border: 1pt none windowtext; padding: 0in;\">Website\r\nCompany Profile, Web Application dan Website E-Commerce (Lazada.co.id,\r\nTokopedia.com,</span></strong>&nbsp;dll) yang komplek dan dinamis.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-family:\" source=\"\" sans=\"\" pro\",sans-serif;=\"\" mso-fareast-font-family:mingliu_hkscs-extb\"=\"\">&nbsp;</span></p>                ', 'upload/gambar/pemweb.jpg', '', 'Admin Creative Media', 'Admin Creative Media', '2019-02-12 12:00:39', '2019-02-12 13:35:36'),
(13, 'Website Desain CMS', '<p><b><font color=\"#0000ff\">C<font style=\"background-color: inherit;\">ara membuat Website</font></font></b> sangatlah mudah jika sudah tahu trik dan tipsnya. Dalam bidang studi Website Desain CMS ini dirancang bagi Anda yang ingin tahu bagaimana <font color=\"#0000ff\" style=\"background-color: inherit;\">cara membuat Website</font> (Toko Online, E-Commerce, Company profile, Web portfolio, Instansi pemerintah, Kementerian, Sekolah, Majalah, Bisnis, Fotografi dll.) menggunakan CMS Wordpress. Alasan kenapa untuk kursus cara membuat Website menggunakan CMS Wordpress ? Alasannya adalah kemampuannya sudah tidak bisa diragukan lagi, dilengkapi dengan desain template yang up-to-date sehingga Platform Wordpress menjadi populer di kalangan Programmer Web selain Open Source, CMS WordPress menjadi salah satu CMS yang Populer dan Powerfull dibanding Joomla dan sejenisnya.</p><p>Bagaimana cara membuat Website dalam waktu singkat? disini kami membimbing Anda tentang<b> cara membuat Website</b> atau membangun sebuah website yang<b> Powerfull dan SEO Friendly</b>. Dengan memanfaatkan fasilitas yang ada mulai dari<b> Widget serta Plugin-plugin</b> dengan konfigurasi yang kompleks, maka Website Anda berpeluang besar akan masuk di halaman \" Rangking 1 di google, Mau? \" Pada bidang studi ini Anda akan diajarkan<b> cara membuat Website</b> yang Menarik, Powerfull dan CEO friendly tanpa harus belajar Web Programming yang begitu rumit (bagi yang belum bisa), Jadi saat ini adalah moment yang TEPAT bagi Anda untuk SEGERA mengambil kursus di bidang<b> Desain Website CMS</b> ini.</p><p>Untuk memenuhi kebutuhan tersebut yaitu<b> cara membuat Website</b> yang menarik dan powerfull kami menyiapkan Pengajar dari Praktisi dan Dosen Profesional yang sudah berpengalaman di bidangnya. Anda bisa belajar mulai dasar hingga tingkat Advanced dalam waktu yang relatif singkat, setelah mengikuti kursus<b> Website Desain CMS</b> (cara membuat Website) siswa mampu membuat, mengelola atau maintenance website secara Profesional serta penerapan teknik SEO Friendly.</p>                ', 'upload/gambar/cara-membuat-website21.jpg', '', 'Admin Creative Media', 'Admin Creative Media', '2019-02-12 12:06:50', '2019-02-12 13:15:08'),
(14, 'Pemrograman Java Android', '<p>Aplikasi Android adalah salah satu aplikasi yang lagi trend dan dicari oleh para penggila gadget atau smartphone canggih saat ini. Tahukah Anda, bahwa semua aplikasi android / mobile yang lagi dicari dan trend itu dasarnya dari <b>Pemrograman Java for Android</b> yang di compile menjadi apk. Sederhana bukan ?&nbsp; Tidak heran jika muncul berbagai macam tutorial di blog dan website yang mengajarkan materi tentang <b>Pemrograman Java Mobile</b> untuk <b>Android</b>.</p><p><br></p><p class=\"MsoNormal\"><strong><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(51, 51, 51); border: 1pt none windowtext; padding: 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Pemrograman Java</span></strong><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;adalah bahasa\r\npemrograman yang dapat dijalankan di berbagai komputer atau smartphone.&nbsp;<strong style=\"outline: 0px;\"><span style=\"border: 1pt none windowtext; padding: 0in;\">Pemrograman</span></strong>&nbsp;ini banyak\r\nmengadopsi sintaksis yang terdapat pada C dan C++ namun dengan sintaksis model\r\nobjek yang lebih. Aplikasi-aplikasi berbasis java umumnya dikompilasi ke dalam\r\np-code (bytecode) dan dapat dijalankan pada berbagai Mesin Virtual Java (JVM).<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p>&nbsp;</o:p></span></p><p>\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><strong><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(51, 51, 51); border: 1pt none windowtext; padding: 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Pemrograman Java</span></strong><span style=\"font-family: &quot;Source Sans Pro&quot;, sans-serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;merupakan\r\nbahasa pemrograman yang bersifat umum/non-spesifik (general purpose), dan\r\nsecara khusus didesain untuk memanfaatkan dependensi implementasi seminimal\r\nmungkin. Karena fungsionalitasnya yang memungkinkan aplikasi java mampu\r\nberjalan di beberapa platform sistem operasi yang berbeda, java dikenal pula\r\ndengan slogannya, “<strong style=\"outline: 0px;\"><span style=\"border: 1pt none windowtext; padding: 0in;\">Tulis\r\nsekali, jalankan di mana pun</span></strong>“. Bidang studi ini&nbsp;merupakan bahasa pemrograman yang\r\npaling populer digunakan, dan secara luas dimanfaatkan dalam pengembangan\r\nberbagai jenis perangkat lunak aplikasi mobile ataupun aplikasi berbasis web.</span><span style=\"font-family:&quot;Source Sans Pro&quot;,sans-serif\"><o:p></o:p></span></p>        ', 'upload/gambar/pemrograman-java.jpg', '', 'Admin Creative Media', 'Admin Creative Media', '2019-02-12 12:32:08', '2019-02-12 13:30:10'),
(15, 'Web Designer', '<p>Bidang studi<b> Web Designer</b> ini sangat kami rekomendasikan bagi Anda yang ingin belajar membuat website dengan bahasa pemrograman HTML & CSS. Jika Anda tidak mempunyai Basic IT tidak menjadi persoalan, karena kami mempunyai 2 Level yaitu Basic (pemula) dan level Advanced (Mahir). Pembelajaran pada bidang studi ini kami fokuskan pada HTML5 dan CSS3 dimana peserta akan mampu membuat Front End website sesuai dengan keinginan yang diinginkan. Materi pembelajaran pada Level Basic mencakup fitur terbaru HTML5 dan CSS3, memahami media Query di CSS, implementasi sintak di HTML5, menerapkan semantic Content Markup & Tag-tag bari, work with audio & video fluid (desain responsive), layout responsive (tablet & smartphone).<b> Kursus Web Designer</b> ini sangatlah cocok bagi Anda yang masih pemula (step-awal) sebelum mengenal bahasa pemrograman PHP & SQL (Database) yaitu yang akan di pelajari pada bidang studi<font style=\"background-color: inherit;\"> </font><font style=\"background-color: inherit;\">Pemrograman Web.</font></p><p>Level selanjutnya setelah Anda menempuh level Basic (pemula) adalah melanjutkan ke Level Advanced (mahir). Materi lanjutan dari level Basic akan dibahas pada level Advanced mencakup pendalaman tentang CSS3 (CSS3 tingkat lanjut) dan pemahaman javascript dan implementasi boostrap untuk menghasilkan template website yang responsive (menyesuaikan) untuk tampilan mobile (tablet, smartphone). Setelah mengikuti<b> Kursus Web Designer</b> ini siswa akan memahami konsep UX (User Experience) dan karakteristik serta prinsip-prinsip UI (User Interface).</p><p>Setelah mengikuti kelas Basic dan Advanced siswa akan mampu membuat Template Website menggunakan Bootstrap yang nantinya bisa dijual di beberapa situs template website internasional. Karya Anda akan mempunyai peluang besar dibeli oleh Perusahaan-Perusahaan Internasional yang menyukai dengan web yang sudah Anda buat.</p>                ', 'upload/gambar/video-bkgd2.jpg', '', 'Admin Creative Media', 'Admin Creative Media', '2019-02-12 12:39:02', '2019-02-12 13:11:09'),
(16, 'Pemrograman Mobile IOS', '<p>Seperti yang kita ketahui bahwa perkembangan teknologi mobile begitu pesat sehingga mengikis pangsa pasar desktop user. Sehingga Perusahaan harus memacu mengikuti perkembangan teknologi mobile saat ini yaitu menciptakan produk-produk aplikasi berbasis mobile mencakup Android & IOS. Beberapa aplikasi mobile yang sangat populer pada masa kini adalah Android & IOS. Sebagai Programmer atau developer aplikasi sudah seharusnya Anda menguasai pemrograman yang berbasis mobile  diantaranya adalah pemrograman Android dan Pemrograman IOS. Kami sebagai Developer aplikasi mobile Android & IOS membuka kesempatan bagi Anda yang ingin belajar dalam pembuatan aplikasi mobile sesuai kebutuhan Anda. Program bidang studi <b>Pemrograman Mobile IOS</b> ini kami rancang khusus bagi Anda yang ingin berselancar membuat aplikasi IOS dengan berbagai macam kebutuhan. <b>Pemrograman Mobile IOS </b>ini mempunyai 2 kelas yaitu <b>Profesional Class</b> dan<b> Executive Class</b>, dimana pada masing-masing kelas mempunyai konsep pendekatan materi yang berbeda. Untuk mengetahui perbedaan dari kedua kelas tersebut Anda bisa mengakses halaman Profil .</p><p><br></p><p class=\"MsoNormal\"><span style=\"font-family: Lato, sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Bidang Studi </span><strong style=\"outline: 0px;\"><span style=\"font-family:\"Lato\",sans-serif;\r\nmso-bidi-font-family:\"Times New Roman\";mso-bidi-theme-font:minor-bidi;\r\nborder:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;padding:0in\">Pemrograman\r\nMobile IOS</span></strong> ini mempunyai 2 Level yaitu Pemrograman Mobile IOS\r\nlevel basic dan Pemrograman Mobile IOS Level Advanced. Level Basic kami\r\nkhususkan bagi Anda seorang pemula yang belum pernah belajar bahasa <strong style=\"outline: 0px;\"><span style=\"font-family:\"Lato\",sans-serif;mso-bidi-font-family:\"Times New Roman\";\r\nmso-bidi-theme-font:minor-bidi;border:none windowtext 1.0pt;mso-border-alt:\r\nnone windowtext 0in;padding:0in\">Pemrogaman Mobile IOS</span></strong> atau belum\r\nmempunyai Basic Programming IOS. Sedangkan Level Advanced adalah materi\r\nlanjutan dari Level Basic, tetapi jika Anda sudah mempunyai Basic Pemrogaman\r\nMobile IOS mungkin belajar secara otodidak Anda bisa mengambil Level Advanced.\r\nHanya saja jika Anda ingin fokus dan menguasai <strong style=\"outline: 0px;\"><span style=\"font-family:\"Lato\",sans-serif;mso-bidi-font-family:\"Times New Roman\";\r\nmso-bidi-theme-font:minor-bidi;border:none windowtext 1.0pt;mso-border-alt:\r\nnone windowtext 0in;padding:0in\">Programmin Mobile IOS</span></strong> kami sangat\r\nmerekomendasikan bagi Anda untuk mengambil 1 Paket yaitu Level Basic dan Level\r\nAdvanced sehingga Anda akan mampu membuat aplikasi dengan harga jual 5 juta\r\nhingga 15 jutaan. Pada bidang studi <strong style=\"outline: 0px;\"><span style=\"font-family:\"Lato\",sans-serif;\r\nmso-bidi-font-family:\"Times New Roman\";mso-bidi-theme-font:minor-bidi;\r\nborder:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;padding:0in\">Pemrograman\r\nMobile IOS</span></strong> Anda akan dibimbing oleh tutor kami dari Kalangan\r\nPraktisi dan Akademis Profesional yang sudah berpengalaman di Mobile IOS\r\nDevelopment.<o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-family: Lato, sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p> </o:p></span></p><p>\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-family: Lato, sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Untuk melihat Silabus Kursus </span><strong style=\"outline: 0px;\"><span style=\"font-family:\"Lato\",sans-serif;mso-bidi-font-family:\"Times New Roman\";\r\nmso-bidi-theme-font:minor-bidi;border:none windowtext 1.0pt;mso-border-alt:\r\nnone windowtext 0in;padding:0in\">Pemrograman Mobile IOS</span></strong>, Anda dapat\r\nberkunjung ke kantor kami untuk konsultasi dan melihat lebih detail. Karena\r\nkami hanya menyiapkan silabus dalam bentuk Hardcopy untuk kebutuhan Internal\r\nkami. Lebih dari 50 siswa setiap bulannya daftar dan bergabung bersama kami\r\nuntuk mengembangkan softskill di keilmuan Informatic Technology  &\r\nMultimedia. Tidak hanya dari masyarakat umum saja, lebih dari 5 perusahaan\r\nsetiap bulannya dimana mereka mengirimkan staff / karyawan mereka untuk\r\nmengikuti Training bersama kami. <strong style=\"outline: 0px;\"><span style=\"font-family:\"Lato\",sans-serif;\r\nmso-bidi-font-family:\"Times New Roman\";mso-bidi-theme-font:minor-bidi;\r\nborder:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;padding:0in\">Apakah\r\nAnda adalah calon siswa kami pada Bulan ini?</span></strong> Jawabanya ada\r\npada Anda. Karena kami sangat tahu bahwa Anda akan memilih tempat terbaik dan\r\nkredibel untuk memebuhi kebutuhan belajar Anda. Jangan belajar pada orang yang\r\nhanya bisa, karena itu akan menyesatkan Anda. Belajarlah pada Pakar dan\r\nPraktisi yang sudah berpengalaman dibidangnya.<o:p></o:p></p>                ', 'upload/gambar/Kursus-Pemrograman-Mobile-IOS-Les-Pemrograman-Mobile-IOS-Training-Mobile-IOS-Kursus-IOS-Surabaya-Les-IOS-Surabaya-03.jpg', '', 'Admin Creative Media', 'Admin Creative Media', '2019-02-12 12:43:57', '2019-02-12 13:34:57'),
(17, 'Photography', '<p><b>Kursus <font color=\"#6ba54a\">Fotografi Profesional</font></b><font color=\"#6ba54a\"> </font><span style=\"color: rgb(0, 0, 0); font-family: \" source=\"\" sans=\"\" pro\",=\"\" \"helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" font-style:=\"\" normal;=\"\" font-variant-ligatures:=\"\" font-variant-caps:=\"\" font-weight:=\"\" 400;=\"\" letter-spacing:=\"\" orphans:=\"\" 2;=\"\" text-align:=\"\" start;=\"\" text-indent:=\"\" 0px;=\"\" text-transform:=\"\" none;=\"\" white-space:=\"\" widows:=\"\" word-spacing:=\"\" -webkit-text-stroke-width:=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" text-decoration-style:=\"\" initial;=\"\" text-decoration-color:=\"\" display:=\"\" inline=\"\" !important;=\"\" float:=\"\" none;\"=\"\"><span> </span></span>dengan layanan dan fasilitas lengkap adalah impian dari semua siswa yang ingin <font color=\"#ff9c00\"><b>Belajar Fotografi</b></font> <b>secara Profesional</b>. Itu semua akan terjawab jika anda mengambil bidang studi kursus<font color=\"#311873\"><span style=\"background-color: rgb(255, 255, 255);\"> <b>Fotografi</b></span><b> </b></font>di <font color=\"#311873\"><b>CREATIVE</b></font><font color=\"#ff9c00\"><b> MEDIA</b></font>. Dibimbing langsung oleh <b>Tentor Profesional</b> di bidang Fotografi dan sudah berpengalaman mendidik banyak<b> Fotografer</b> dari berbagai kalangan untuk kebutuhan<b> Hobi, Bisnis dan Profesi</b>. Dalam<b> kursus Fotografi </b>anda akan mampu menguasai teknik-teknik<b> Fotografi Profesional</b> dalam waktu yang singkat dan efektif serta biaya di <b style=\"\"><font color=\"#6ba54a\">JAMIN MURAH</font></b>.</p><p><br></p><p>Pada umumnya kursus<b><font color=\"#ff9c00\"> Fotografi</font></b> itu <b>MAHAL</b> tapi kami berbeda, hanya kami yang berani memberikan HARGA <b>kursus <font color=\"#731842\">Fotografi</font></b> dengan<b> BIAYA TERJANGKAU</b>, demi tercapainya Visi dan Misi kami yang besar salah satunya \"<b>Mencerdaskan generasi muda Indonesia menjadi generasi yang berkompeten dan berdaya saing Global</b>\". Sangat berbeda dengan <b>kursus <font color=\"#6ba54a\">Fotografi</font></b><font color=\"#6ba54a\"> </font>ditempat lain yang hanya menguntungkan secara personal tetapi tidak mampu membantu dan memberikan kontribusi positif dan menjawab kebutuhan siswa dengan kondisi ekonomi terbatas. Tentunya kami sangat prihatin tetapi keputusan semacam itu menjadi hak setiap orang / profesi untuk menentukan harga sesuai yang dia inginkan.</p><p><br></p><p class=\"MsoNormal\"><span style=\"font-family: \"Source Sans Pro\", sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Pada kursus </span><strong style=\"font-style: inherit; outline: 0px;\"><span style=\"font-family: \"Source Sans Pro\", sans-serif; color: rgb(255, 102, 0); border: 1pt none windowtext; padding: 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"outline: 0px;\">Belajar Fotografi</span></span></strong><span style=\"font-family: \"Source Sans Pro\", sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> siswa akan mampu menghasilkan karya foto yang\r\nberkualitas tinggi tanpa melakukan editing menggunakan software pendukung foto\r\npada umumnya, misalnya Adobe Photoshop dll. Untuk menghasilkan karya foto\r\nseperti itu tentunya ada teknik-teknik dan banyak pemikiran serta pertimbangan\r\nkhusus yang akurat dalam penerapannya. Dengan mengikuti kursus </span><strong style=\"font-style: inherit; outline: 0px;\"><span style=\"font-family: \"Source Sans Pro\", sans-serif; color: rgb(153, 51, 102); border: 1pt none windowtext; padding: 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"outline: 0px;\">Belajar Fotografi</span></span></strong><span style=\"font-family: \"Source Sans Pro\", sans-serif; color: rgb(153, 51, 102); border: 1pt none windowtext; padding: 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> </span><span style=\"font-family: \"Source Sans Pro\", sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">ini, kami akan\r\nmemberikan semua bekal yang anda butuhkan serta dengan leluasa anda bisa\r\nberdiskusi secara bebas (kapan saja dan dimana saja) bersama</span><strong style=\"font-style: inherit; outline: 0px;\"><span style=\"font-family: \"Source Sans Pro\", sans-serif; color: rgb(153, 204, 0); border: 1pt none windowtext; padding: 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"outline: 0px;\"> Tentor Profesional</span></span></strong><span style=\"font-family: \"Source Sans Pro\", sans-serif; color: rgb(153, 204, 0); border: 1pt none windowtext; padding: 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> </span><span style=\"font-family: \"Source Sans Pro\", sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">kami.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family: \"Source Sans Pro\", sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p> </o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"font-family:\"Source Sans Pro\",sans-serif;\r\ncolor:#404040\">Kenapa Kursus</span><span style=\"font-style: inherit; font-weight: inherit; outline: 0px;\"><strong style=\"font-style: inherit; outline: 0px;\"><span style=\"font-family:\"Source Sans Pro\",sans-serif;\r\ncolor:#99CC00;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\r\npadding:0in\"> Fotografi</span></strong></span><span style=\"font-family:\r\n\"Source Sans Pro\",sans-serif;color:#404040\"> itu penting? Banyak orang\r\ndiluar sana yang memunyai camera berkualitas tinggi, tapi hanya sedikit yang\r\nmampu menjual kemampuannya secara tepat. Hal itu karena mereka tidak mempunyai\r\nkemampuan khusus untuk menghasilkan karya yang menjual. Perlu anda ketahui\r\nbahwa untuk mendapatkan <strong style=\"font-style: inherit; outline: 0px;\"><span style=\"border: 1pt none windowtext; padding: 0in;\">Profit\r\nbesar puluhan juta setiap bulan</span></strong> dari hasil memotret itu\r\nhal yang sangat mudah jika anda mengikuti kursus </span><span style=\"font-style: inherit; font-weight: inherit; outline: 0px;\"><strong style=\"font-style: inherit; outline: 0px;\"><span style=\"font-family:\"Source Sans Pro\",sans-serif;color:#FF6600;\r\nborder:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;padding:0in\">Belajar\r\nFotografi.</span></strong></span><span style=\"font-family:\"Source Sans Pro\",sans-serif;\r\ncolor:#404040\"> Besarnya kebutuhan pasar akan produk fotografi membuat\r\nindustri ini berkembang pesat, dan sekarang adalah kesempatan anda untuk meraih\r\nsukses.<o:p></o:p></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"font-family:\"Source Sans Pro\",sans-serif;\r\ncolor:#404040\"> </span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; outline: 0px;\"><span style=\"font-family:\"Source Sans Pro\",sans-serif;color:#404040\">Materi\r\nkursus </span><span style=\"font-style: inherit; font-weight: inherit; outline: 0px;\"><strong style=\"font-style: inherit; outline: 0px;\"><span style=\"font-family:\"Source Sans Pro\",sans-serif;\r\ncolor:#99CC00;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\r\npadding:0in\">Belajar Fotografi</span></strong><span style=\"font-family:\"Source Sans Pro\",sans-serif;\r\ncolor:#99CC00;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\r\npadding:0in\"> </span></span><span style=\"font-family:\"Source Sans Pro\",sans-serif;\r\ncolor:#404040\">ini dirumuskan berdasarkan riset selama bertahun-tahun dari\r\npengalaman yang didapat dari<strong style=\"font-style: inherit; outline: 0px;\"><span style=\"border: 1pt none windowtext; padding: 0in;\"> Tentor\r\nProfesional</span></strong> kami yaitu sebagai Fotografer handal pada\r\nbidang </span><span style=\"font-style: inherit; font-weight: inherit; outline: 0px;\"><strong style=\"font-style: inherit; outline: 0px;\"><span style=\"font-family:\"Source Sans Pro\",sans-serif;\r\ncolor:#993366;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\r\npadding:0in\">Wedding, Pre-Wedding, Indoor Studio, Outdoor, Product, Company\r\nProfile, Advertising, Magazine dll.</span><o:p></o:p></strong></span></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><strong><span style=\"font-family:\"Source Sans Pro\",sans-serif;\r\ncolor:#993366;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\r\npadding:0in\"> </span></strong></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"font-family: \"Source Sans Pro\", sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Kegagalan menjadi biaya mahal dalam meraih\r\nkesuksesan. Dengan belajar dari ahlinya, anda bisa menghindarinya dan sukses di\r\nbisnis fotografi ini pun bisa diraih secara efektif, efisien dan lebih cepat.\r\nDaftar sekarang juga. Klik </span><strong style=\"outline: 0px;\"><span style=\"font-style: inherit; font-weight: inherit; outline: 0px;\"><span style=\"font-family: \"Source Sans Pro\", sans-serif; color: red; border: 1pt none windowtext; padding: 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><a href=\"http://www.infocreativemedia.com/pendaftaran-online\" title=\"Pendaftaran Online Belajar Fotografi\" style=\"font-style: inherit; font-weight: inherit; outline: 0px; transition: all 700ms ease 0s; background-position: 0px 0px;\"><span style=\"color: purple;\">DISINI</span></a>, </span></span></strong><span style=\"font-family: \"Source Sans Pro\", sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Peserta terbatas\r\ndan pendaftaran ditutup sewaktu-waktu. Anda mau mengikuti kursus </span><strong style=\"font-style: inherit; outline: 0px;\"><span style=\"font-family: \"Source Sans Pro\", sans-serif; color: rgb(153, 51, 102); border: 1pt none windowtext; padding: 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"outline: 0px;\">Belajar Fotografi</span></span></strong><span style=\"font-family: \"Source Sans Pro\", sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">, diskusikan dengan tim kreatif kami.</span><strong><span style=\"font-family:\"Source Sans Pro\",sans-serif;color:#993366;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0in;padding:0in\"><o:p></o:p></span></strong></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><strong><span style=\"font-family:\"Source Sans Pro\",sans-serif;\r\ncolor:#993366;border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\r\npadding:0in\"> </span></strong></p><p style=\"margin: 0in 0in 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"font-family:\"Source Sans Pro\",sans-serif;\r\ncolor:#404040\"> </span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-family:\"Source Sans Pro\",sans-serif\"> </span></p>                ', 'upload/gambar/belajar-fotografi.jpg', '', 'Admin Creative Media', 'Admin Creative Media', '2019-02-12 13:06:20', '2019-03-25 20:40:56');
INSERT INTO `bidang_studi` (`id_studi`, `nama_studi`, `deskripsi`, `gambar`, `harga`, `created_by`, `updated_by`, `created_date`, `updated_date`) VALUES
(18, 'Pemrograman Dasar', '<div style=\"text-align: left; color: rgb(34, 34, 34);\" palatino=\"\" linotype\",=\"\" palatino,=\"\" serif;=\"\" font-size:=\"\" 15.4px;\"=\"\"><span style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Pemrograman</span><span style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">&nbsp;adalah proses menulis, menguji dan memperbaiki (</span><i style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">debug</i><span style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">), dan memelihara kode yang membangun sebuah program komputer</span><span style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">. Kode ini ditulis dalam berbagai bahasa pemrograman</span><span style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">. Tujuan dari pemrograman adalah untuk memuat suatu program yang dapat melakukan suatu perhitungan atau \'pekerjaan\' sesuai dengan keinginan si pemrogram (programmer). Untuk dapat melakukan pemrograman, diperlukan keterampilan dalam&nbsp;</span><span style=\"color: black;\"><span style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;\"=\"\"><span style=\"font-size: 13px;\">algoritma</span></span><span style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">,&nbsp;</span><span style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;\"=\"\"><span style=\"font-size: 13px;\">logika, bahasa pemrograman</span></span></span><span style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">, dan di banyak kasus, pengetahuan-pengetahuan lain seperti matematika</span><span style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">.</span></div><div style=\"\"><div style=\"text-align: left;\"><font color=\"#222222\" face=\"Arial, Tahoma, Helvetica, FreeSans, sans-serif\"><span style=\"font-size: 13px;\"><br></span></font></div><span style=\"color: rgb(34, 34, 34); font-family: Arial, Tahoma, Helvetica, FreeSans, sans-serif; font-size: 13px;\" palatino=\"\" linotype\",=\"\" palatino,=\"\" serif;=\"\" font-size:=\"\" 15.4px;\"=\"\"><div style=\"text-align: left;\"><span trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Pemrograman adalah sebuah seni dalam menggunakan satu atau lebih algoritma</span><span trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">&nbsp;yang saling berhubungan dengan menggunakan sebuah&nbsp;</span><span trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;\"=\"\">bahasa pemrograman</span><span trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">&nbsp;tertentu sehingga menjadi sebuah program komputer. Bahasa pemrograman</span><span trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">&nbsp;yang berbeda mendukung gaya pemrograman yang berbeda pula. Gaya pemrograman ini biasa disebut paradigma pemrograman</span><span trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">.&nbsp;</span></div></span></div><div style=\"text-align: left; font-family: Arial, Tahoma, Helvetica, FreeSans, sans-serif; font-size: 13px; color: rgb(34, 34, 34);\"><span style=\"font-family: Georgia, Utopia, \" palatino=\"\" linotype\",=\"\" palatino,=\"\" serif;=\"\" font-size:=\"\" 15.4px;\"=\"\"><span style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">&nbsp; </span></span></div><div style=\"text-align: left; font-family: Arial, Tahoma, Helvetica, FreeSans, sans-serif; font-size: 13px; color: rgb(34, 34, 34);\"><span style=\"font-family: Georgia, Utopia, \" palatino=\"\" linotype\",=\"\" palatino,=\"\" serif;=\"\" font-size:=\"\" 15.4px;\"=\"\"><span style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">Pengertian Pemrograman&nbsp;</span><span style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">adalah</span><span style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">&nbsp;</span><span style=\"font-family: \" trebuchet=\"\" ms\",=\"\" trebuchet,=\"\" sans-serif;=\"\" font-size:=\"\" 13px;\"=\"\">suatu kumpulan urutan perintah ke komputer untuk mengerjakan sesuatu, dimana instruksi tersebut menggunakan bahasa yang dimengerti &nbsp;oleh komputer atau dikenal dengan bahasa pemrograman.</span></span><br></div>                ', 'upload/gambar/header-image-algoritma.jpg', '', 'Admin Creative Media', 'Admin Creative Media', '2019-02-19 15:51:31', '2019-02-19 16:07:05');
